(139500, NULL, '- Dân trí tạm, không cao lắm, có nuôi gà, và tổ chức nhậu nhẹt.\r\n- Đầu hẻm là tiệm hớt tóc, trong hẻm thì kinh doanh cho thuê phòng, văn phòng công ty và ở.\r\n- Nhà còn mới, chủ nhà mới xây hoặc sửa năm 2019, diện tích xây dựng 39.7m2, diện tích sàn 139.6m2, kết cấu trệt 2 lầu sân thượng, có 6 phòng ngủ.\r\n- Cách mặt tiền chỉ tầm 50m, gần đoạn Huỳnh Văn Bánh và Trần Huy Liệu, bán kính 1km xung quanh đầy đủ các tiện ích như trường học, bệnh viện, ngân hàng,....\r\n- Nhà hướng Đông Bắc, nhà 3 mặt tiền hẻm, khuôn đất 3.58*13.1m, hậu hơi cong cong, nhà không bị cống, cột điện,....\r\n- Ngọc Quý + Tuyết Mai nhập.', 0x0000000001010000005dc1475b6cab5a4032a9f2cd6d952540, 79, 768, 27082, 181, '175/6', NULL, NULL, '175/6 Huỳnh Văn Bánh, Phường 12, Quận Phú Nhuận, Thành phố Hồ Chí Minh', '', 8.4, 2, 8500000000, '3.60', '13.10', '48.30', 176.00, NULL, 'VNĐ', '39.70', '139.60', 3, NULL, NULL, 1, NULL, 2, 1, 6, NULL, NULL, 3, NULL, 1, 6, 5, 1, NULL, 1, NULL, 5, NULL, NULL, 1, NULL, 3, 92161, NULL, 180, NULL, '2020-10-24 12:33:11', '2020-11-18 08:30:06', NULL, NULL, NULL, 0, '2020-10-24 12:26:08', NULL, NULL, 0, 0, NULL, NULL, NULL),
(139501, NULL, '- Dân trí cao, khu vực an ninh, yên tĩnh.\r\n- Khu vực cho thuê căn hộ và ở, trong hẻm có một số văn phòng shop bán đồ\r\n- Đây là đất trống, không có nhà.\r\n- Cách mặt tiền Lê Văn Sỹ khoảng 100m, gần cây xăng Lê Văn Sỹ, đoạn ngã tư Lê Văn Sỹ và Trần Quang Diệu, hẻm này thông hẻm 16 Trần Quang Diệu.\r\n- Nhà hướng Đông Bắc, khuôn đất 3*10m, 29.39m2, không vuông vức lắm, không bị lỗi cống cột điện, đâm đường.', 0x00000000010100000068ba8dbc62ab5a4038f92d3a59922540, 79, 770, 27136, NULL, '315/24F', NULL, NULL, NULL, '', 2.6, 2, 2600000000, '3.00', '10.00', '29.40', 88.00, NULL, 'VNĐ', NULL, NULL, 1, NULL, NULL, 1, NULL, 2, 1, 6, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 4, NULL, NULL, 1, NULL, 3, 92186, NULL, 180, NULL, '2020-10-24 12:45:11', '2020-11-10 09:07:20', NULL, NULL, NULL, 0, '2020-10-24 12:33:11', NULL, NULL, 0, 0, NULL, NULL, NULL),
