(139642, NULL, '- Dân trí cao, khu vực an ninh, yên tĩnh, tốt.\r\n- Nhà xây khoảng năm 2017, còn mới bên ngoài, bên trong cần sửa lại tí, kết cấu trệt 2 lầu sân thượng, 4 phòng ngủ, 3 WC, diện tích xây dựng 44.5m2, diện tích sàn 138.9m2.\r\n- Khu vực chủ yếu ở, cho thuê phòng, làm văn phòng và cửa hàng nhỏ lẻ.\r\n- Nhà cách hẻm xe hơi 6m chỉ 10m, cách mặt tiền Lê Văn Sỹ và Trần Quang Diệu tầm 100m, gần cây xăng Lê Văn Sỹ. bán kính 1km xung quanh đầy đủ tiện ích như chợ, trường học, ngân hàng, bệnh viện,......\r\n- Nhà hướng Đông Bắc, ngang 3.3 dài 12m nở hậu 4.15m, 44.5m2 công nhận, nhà không bị lỗi phong thủy như cột điện, đâm đường', 0x0000000001010000002b40fb2760ab5a40c02436df6f922540, 79, 770, 27136, NULL, '315/28D', NULL, NULL, NULL, '', 6.3, 2, 6300000000, '3.30', '12.00', '44.50', NULL, '0', 'VNĐ', '36.20', '138.90', 3, NULL, NULL, NULL, NULL, 2, 1, 6, NULL, NULL, 3, NULL, 1, 4, 3, 1, 1, 1, NULL, 3, NULL, NULL, NULL, NULL, 2, 90308, NULL, 180, NULL, '2020-10-29 09:38:51', '2020-10-30 08:44:44', NULL, NULL, NULL, 0, NULL, NULL, 138985, NULL, 1, NULL, NULL, NULL),
