(139754, NULL, 'Nhà có 3 mặt tiền, mặt tiền đường Võ Thị Sáu, đoạn sầm uất Quận 3, và 2 mặt tiền hẻm, nhà thuộc lề phải đường, nhà rất sáng, thoáng và mát quanh năm.\r\nTầng trệt, ngang 3,3 dài 19 m, Đặc biệt lên tầng 1 đến tầng 4, nở rộng chiều ngang ra thành 3,8 m, tổng sàn sử dụng 314 m2.\r\nXe ô tô đậu trong nhà, nhà có cửa hông để đi xe gắn máy riêng, rất thuận tiện, tầng trệt dành để xe ô tô và xe gắn máy (nếu cần thiết).\r\nNhà có 1 trệt và 4 lầu, rất đẹp, sổ hồng, Nhà lót sàn gỗ mới rất đẹp, mỗi tầng có 1 nhà vệ sinh riêng.\r\nNhà hướng Đông Nam, Nhà có hẻm hông là hẻm cụt, rất an ninh và yên tĩnh, một vài hộ dân cao cấp ở.\r\nNhà có 4 đồng điện và 4 đồng hồ nước, gắn và sử dụng thang máy (sử dụng 1 đồng hồ điện riêng) rất thuận tiện lên xuống và tiết kiệm điện.\r\nNhà rất thuận tiện để ở và kinh doanh, mua bán, làm văn phòng công ty, vì khu vực này rất sầm uất và kinh doanh tốt quận 3 (được đánh giá là Trung tâm tài chính và kinh tế của Quận 3).', NULL, 79, 770, 27121, 184, '164', NULL, NULL, '164 Võ Thị Sáu, Phường 08, Quận 3, Thành phố Hồ Chí Minh', '', 19, 2, 19000000000, '3.30', '19.00', '0.00', NULL, '0', 'VNĐ', '0.00', '314.00', 3, NULL, NULL, NULL, NULL, 1, 1, 8, 0, NULL, 5, NULL, NULL, 6, 4, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1, NULL, 2, 87924, NULL, 246, NULL, '2020-11-05 09:25:45', '2020-11-05 10:12:14', NULL, NULL, NULL, 0, NULL, NULL, 99570, NULL, 1, NULL, NULL, NULL),
