(139812, NULL, 'Nhà xây mới năm 2020 . Do kiến trúc sư thiết kế . Ngôi nhà mang phong cách nhà phố hiện đại của kiến trúc châu Âu . Chàng kiến trúc sư trẻ đã mang đến cho chúng ta một biệt thự mini phố cực kỳ mới lạ và khác biệt hoàn toàn so với các căn nhà phố khác. Đây được xem như là một siêu phẩm nhà phố đình đám nhất trong những ngày đầu năm 2019. Có đầy đủ bản vẽ thiết kế và sơ đồ hoàn công. Thiết kế hiện đại , lối thiết kế mang thế giới xanh vào căn nhà. Tạo nên không gian căn nhà vô cùng thoáng mát và tạo cảm giác dễ chịu cho người xem\r\n- Nội thất cao cấp , được gia chủ tặng tất cả nội thất trong nhà lên tới 300 triệu đồng , như : bộ sopha , bàn ăn , tủ rượu , 4 tủ quần áo + kệ tivi , máy nước nóng năng lườn mặt trời ,...\r\n - Vị trí : Nằm trên con hẻm 6m một trục thuộc đường Quang Trung , phường 8 . Cách đường chính 50m . Có thể ở , mở văn phòng công ty\r\n  Với đầy đủ mọi tiện ích xung quanh . Gần  chợ , siêu thị , trường học , nhà văn hóa thiếu nhi , ngân hàng samcombank, vietcombank, agribank, gần siêu thị , các trường cấp 123 nằm trong bán kính 200m , trung tâm mua sắm , khu vui chơi giải trí , công viên , chung cư . Nơi có cơ sở hạ tầng phát triển bậc nhất quận Gò Vấp .\r\n - Hướng Đông Bắc ( Tây Tứ Trạch )\r\n - Di chuyển thuận tiện : nằm trong khu vực cao ráo không ngập nước , không kẹt xe . Đi sân bay 5 phút , đi các quận lân cận nhanh chóng,..', 0x0000000001010000007d3d5fb35ca95a405839b4c876ae2540, 79, 764, 26898, 3683, '32/28/4A', NULL, NULL, '32/28/4A Quang Trung, Phường 08, Quận Gò Vấp, Thành phố Hồ Chí Minh', '', 6.5, 2, 6500000000, '4.00', '16.00', '64.00', 102.00, NULL, 'VNĐ', NULL, NULL, 3, NULL, NULL, 1, NULL, 2, NULL, 6, NULL, NULL, 2, NULL, 2, 4, 6, 1, NULL, 1, NULL, NULL, NULL, NULL, 1, NULL, 3, 93225, NULL, 237, NULL, '2020-11-06 11:56:22', '2020-11-06 16:07:27', NULL, NULL, NULL, 0, '2020-11-06 11:31:02', NULL, NULL, NULL, 0, NULL, NULL, NULL),
