(139884, NULL, '- Mặt tiền 8m, dài 18m vuông vức, kiến trúc pha lẫn cổ điển và hiện đại, nhà hàng đang thuê làm ăn rất khá.\r\n- Hướng Đông Nam.\r\n- Nội thất gỗ cao cấp, các phòng gần như full 100% nội thất cơ bản như điều hoà, nóng lạnh, có sẵn máy giặt ở tầng trên cùng.\r\n\r\nĐặc biệt : Đang có hợp đồng thuê nhà hàng Pháp đến năm 2022 - có thể thương lượng đền hợp đồng để giao nhà ngay nếu cần thiết hoặc để tiếp tục cho thuê, đỡ phải mất thời gian, chi phí tìm người cho thuê nếu chưa có nhu cầu sử dụng.\r\n\r\nVì xây dựng nhà cũng nhiều tâm huyết nên mình để lại giá thấp nhất có thể 45 tỷ, bạn nào có thiện chí liên hệ mình làm việc.', NULL, 79, 768, 27061, 641, '8', NULL, NULL, '8 Hoa Mai, Phường 02, Quận Phú Nhuận, Thành phố Hồ Chí Minh', '', 45, 2, 45000000000, '8.00', '18.00', '144.00', NULL, '0', 'VNĐ', '94.00', '350.20', 3, NULL, NULL, NULL, NULL, 1, 1, 7, 0, NULL, 4, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12, NULL, NULL, 1, NULL, 2, 91274, NULL, 230, NULL, '2020-11-08 19:08:36', '2020-11-10 08:47:46', NULL, NULL, NULL, 0, NULL, NULL, 122466, NULL, 1, NULL, NULL, NULL),
