(140029, NULL, 'Nhà do đội ngũ kiến trúc sư nhiều năm kinh nghiệm thiết kế. Xây cao cấp, thiết kế sang trọng theo phong cách chuẩn Châu Âu, cực kỳ thoáng mát 2 giếng trời, mỗi phòng điều mở được của sổ lấy sáng lấy gió tự nhiên.\r\n-Nội thất : sang trọng, cao cấp, tủ bếp gỗ, sàn gỗ cao cấp từng phòng, bồn tắm đứng, cầu thang kính cường lực, thiết bị vệ sinh hiệu TOTO, sử dụng năng lượng mặt trời, màn cửa cách nhiệt, giấy dán tường trang trí. Tặng lại toàn bộ nội thất.\r\n-Tiện ích : Nhà mặt tiền đường xe hơi, khu vực nhiều cây xanh đối diện công viên thoáng mát.. có thể kinh doanh mọi ngành nghề hoặc mở công ty lớn... đặt biệt nghỉ dưỡng cực kỳ thích hợp.\r\n-Vị Trí : Trung tâm quận Phú Nhuận, , đường thông ra Phan Đăng Lưu, Phan Xích Long, xung quanh nhiều trường học, ngân hàng, chợ, siêu thị và nhiều tiện ích dịch vụ khác bán kính 1km.\r\n-Pháp lý SỔ HỒNG 2016.', 0x0000000001010000002ed4505903ac5a402986f5903a9b2540, 79, 768, 27052, 198, '174B', NULL, NULL, '174B Trần Kế Xương, Phường 07, Quận Phú Nhuận, Thành phố Hồ Chí Minh', '', 10.7, 2, 10700000000, '4.40', '15.00', '58.50', NULL, '0', 'VNĐ', '0.00', '260.00', 3, NULL, NULL, NULL, NULL, 1, 1, 4, NULL, NULL, 5, NULL, 2, 5, 5, 1, 1, 1, NULL, 5, NULL, NULL, 1, NULL, 2, 85248, NULL, 237, NULL, '2020-11-10 18:26:30', '2020-11-11 10:03:54', NULL, NULL, NULL, 0, NULL, NULL, 137391, NULL, 1, NULL, NULL, NULL),
