(140054, NULL, 'Nhà hẻm ôtô 5m, hẻm thông, 54/19 Đào Duy Anh, P.9, Phú Nhuận, DT 5x19m (công nhận 93,2m2), trệt 3 lầu, 5 phòng, nhà đẹp, NTCC, vào ở ngay. Nhà hướng Đông Nam, nhà khu dân trí cao, lịch sự, gần sân bay, trường học, siêu thị, công viên, bệnh viện', 0x000000000101000000839edb844dab5a40fc388d6b519d2540, 79, 768, 27049, 296, '54/19', NULL, NULL, '54/19 Đào Duy Anh, Phường 09, Quận Phú Nhuận, Thành phố Hồ Chí Minh', '', 16.5, 2, 16500000000, '5.00', '19.00', '93.20', NULL, '0', 'VNĐ', '78.20', '305.90', 3, NULL, NULL, NULL, NULL, 2, 1, 1, 0, NULL, 4, NULL, 1, 5, 6, 1, 1, NULL, NULL, 4, NULL, NULL, 1, NULL, 2, 83855, NULL, 230, NULL, '2020-11-10 21:44:22', '2020-11-11 10:13:43', NULL, NULL, NULL, 0, NULL, NULL, 118958, NULL, 1, NULL, NULL, NULL),
(140055, NULL, '- Dân trí cao, khu vực tốt.\r\n- Khu vực chủ yếu làm văn phòng công ty, các cửa hàng, các mặt hàng kinh doanh, cho thuê phòng và ở.\r\n- Nhà xây khoảng năm 2015, 56m2 xây dựng, 206.5m2 sàn có 3 tầng.\r\n- Đây là mặt tiền Cù Lao, cách 50m tới Trường Sa, gần Phan Xích Long, Hoa Lan, Hoa Hồng.\r\n- Nhà hướng Đông Bắc, vuông vức, 4*14m, 56m2 công nhận, không bị các lỗi phong thủy nhưng hơi gần Chùa Quan Âm Tu Viện.', 0x000000000101000000786c1fc910ac5a409f4346b3bf972540, 79, 768, 27061, 230, '17', NULL, NULL, '17 Cù Lao, Phường 02, Quận Phú Nhuận, Thành phố Hồ Chí Minh', '', 16.5, 2, 16500000000, '4.00', '14.00', '56.00', NULL, '0', 'VNĐ', '56.00', '206.50', 3, NULL, NULL, NULL, NULL, 1, 1, 6, 0, NULL, 3, NULL, 1, 4, 4, 1, 1, 1, NULL, 10, NULL, NULL, 1, NULL, 2, 87761, NULL, 230, NULL, '2020-11-10 21:49:32', '2020-11-11 10:13:50', NULL, NULL, NULL, 0, NULL, NULL, 48865, NULL, 1, NULL, NULL, NULL),
(140056, NULL, '- nhà mặt tiền chính chủ bán DT 50m2 1 trệt 1 lửng 2 lầu\r\n- kích thước 13,8m x 3,65m\r\n- phía sau có hẻm cửa mở thông ra đường tiện lợi trong trường hợp khẩn cấp\r\n- có 2 nguồn nước\r\n- số nhà thần tài 39\r\n- cách chợ 100m, cách trường cấp 1,2 từ 500m-1km\r\n- gần bệnh viện Hoàn Mỹ, khu dân cư sầm uất, an ninh\r\n- đang cho thuê bán gạo, nhà cũ tiện nâng cấp làm mới để ở hoặc kinh doanh. ĐANG CHO THUÊ MB = 7tr/th.', 0x000000000101000000c72de6e786ab5a40a2b8e34d7e9b2540, 79, 768, 27043, 4978, '39', NULL, NULL, '39 Nguyễn Đình Chiểu, Phường 04, Quận Phú Nhuận, Thành phố Hồ Chí Minh', '', 10.5, 2, 10500000000, '3.70', '13.80', '55.50', NULL, '7.000000', 'VNĐ', '0.00', '0.00', 3, NULL, NULL, NULL, NULL, 2, 1, 0, NULL, NULL, 3, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1, NULL, 2, 90852, NULL, 230, NULL, '2020-11-10 22:07:09', '2020-11-11 10:14:03', NULL, NULL, NULL, 0, NULL, NULL, 136846, NULL, 1, NULL, NULL, NULL),
