(140177, NULL, 'Lô góc 2 hướng: ĐTT và TTT.\r\n+ Lô góc thoáng sáng tất cả các phòng.\r\n+ Nhà hiện 1 trệt + 2 lầu: 4PN. Tặng toàn bộ nội thất cho khách thiện chí.\r\n+ Hiện là 2 nhà riêng biệt ngăn ra để cho thuê:\r\n- Phần bên HXH là 1 trệt + 2 lầu: 2PN, có cửa riêng và cầu thang riêng, cho thuê 7 triệu/tháng.\r\n- Phần bên hẻm ba gác là 1 trệt + Lầu: 2PN, 2WC, nội thất được trang bị đầy đủ: Điều hoà, giường tủ đều mới. Hiện cho thuê phần này 10 triệu/tháng.\r\n+ 1 Hẻm ba gác thông. 1 hẻm Ô tô vào đến cửa nhà nhà.\r\n+ Khu vực rất thuận lợi cho việc đi lại. Ra sân bay chưa đến 10’ theo Phạm Văn Đồng. Chợ Phan Văn Trị cũng như siêu thị, trường học, bệnh viện trong bán kính 300m', 0x000000000101000000c3499a3fa6ac5a407cef6fd05e9d2540, 79, 765, 26908, NULL, '377/52', NULL, NULL, NULL, '', 4.6, 2, 4600000000, '3.50', '14.00', '49.00', NULL, '0', 'VNĐ', '0.00', '0.00', 3, NULL, NULL, NULL, NULL, 2, 1, 8, NULL, NULL, 2, NULL, NULL, 3, 2, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1, NULL, 2, 93667, NULL, 220, NULL, '2020-11-14 11:21:31', '2020-11-14 20:37:31', NULL, NULL, NULL, 0, NULL, NULL, 140018, NULL, 1, NULL, NULL, NULL),
