(140255, NULL, '- Dân trí cao, khu vực an ninh, sạch sẽ.\r\n- Nhà cũ, kết cấu trệt lầu, đã xây 30~40 năm, diện tích xây dựng 36.7m2, diện tích sàn 77m2.\r\n- Khu vực hẻm có làm spa, văn phòng công ty, cho thuê phòng và ở.\r\n- Hẻm 4.7m Nguyễn Trọng Tuyển thông hẻm 62  Nguyễn Đình Chính, cách mặt tiền Nguyễn Đình Chính và Nguyễn Trọng Tuyển chỉ 50m, gần Trần Huy Liệu, Nguyễn Văn Trỗi, bán kính 1km xung quanh đầy đủ tiện ích như chợ, trường học, bệnh viện, ngân hàng,.....\r\n- Khuôn đất 4.6m nở hậu 4.7m dài 11.7m, diện tích công nhận 54.6m2, hướng Tây Nam, không bị các lỗi phong thủy như cống, cột điện, đâm đường,.....', 0x00000000010100000046539f2273ab5a40c0a2ecfe05982540, 79, 768, 27067, 5365, '91/17', '91/19', 5365, '91/17 Nguyễn Trọng Tuyển, Phường 15, Quận Phú Nhuận, Thành phố Hồ Chí Minh', '91/19, Nguyễn Trọng Tuyển', 7.6, 2, 7600000000, '4.60', '11.70', '54.60', 139.00, NULL, 'VNĐ', '36.70', '77.00', 3, NULL, NULL, 1, NULL, 2, 1, 7, NULL, NULL, 2, NULL, 1, 2, 2, 1, NULL, 1, NULL, 5, NULL, NULL, 1, NULL, 3, 94247, NULL, 180, NULL, '2020-11-16 16:30:51', '2020-11-16 17:01:00', NULL, NULL, NULL, 0, '2020-11-16 16:12:41', NULL, NULL, NULL, 0, NULL, NULL, NULL),
(140256, NULL, '- Dân trí ổn, khu vực sầm uất, an ninh.\r\n- Nhà mặt tiền khu vực kinh doanh sầm uất đủ mọi loại ngành nghề khác nhau cửa hàng, quán ăn uống, spa, văn phòng,......\r\n- Nhà xây khoảng 15 năm, hơi cũ, diện tích xây dựng 59m2, diện tích sàn 172.4m2, kết cấu trệt lửng 3 lầu.\r\n- Đây là nhà mặt tiền Nguyễn Trọng Tuyển, cách 100m tới Nguyễn Đình Chính và Phan Đình Phùng, gần chợ Phú Nhuận, cầu Kiệu,... bán kính 1km xung quanh đầy đủ tiện ích như chơ, trường học, bệnh viện, ngân hàng,......\r\n- Nhà hướng chính Nam, 3.6m*16m vuông vức, 59m2 công nhận, có cột điện, không bị các lỗi như cống, đâm đường, top hậu.', 0x0000000001010000002369ecd583ab5a40a43b3dea39982540, 79, 768, 27067, 5365, '50', NULL, NULL, '50 Nguyễn Trọng Tuyển, Phường 15, Quận Phú Nhuận, Thành phố Hồ Chí Minh', '', 13.5, 2, 15000000000, '3.60', '16.00', '59.00', 254.00, NULL, 'VNĐ', '59.00', '172.40', 3, NULL, NULL, 1, NULL, 1, 1, 3, NULL, NULL, 4, NULL, 1, 5, 5, 1, NULL, 1, NULL, 10, NULL, NULL, 1, NULL, 3, 94258, NULL, 180, NULL, '2020-11-16 16:46:44', '2021-02-22 16:54:33', NULL, NULL, NULL, 0, '2020-11-16 16:30:52', NULL, NULL, 0, 0, NULL, NULL, NULL),
