(140265, NULL, 'Hẻm xe hơi Vũ Tùng p2 Bình Thạnh,\r\nVị trí đắc địa bậc quận Bình Thạnh, giáp quận 1, bán kính xung quanh không thiếu gì, đi bộ ra chợ Bà Chiểu,UBND phường, quận. Hẽm 90 toàn nhà cao tầng đẹp mới xây và an ninh khu vực, hẽm thông nhiều xe qua lại thích hợp kinh doanh nhỏ tại nhà.\r\nDTCN 52,9m2 + sân nhỏ 6,4m2 phía trước.Hướng Đông Nam thoáng mát, đất nở hậu ngang trên 4m làm ăn phát đạt .Nhà xây 1 trệt 1 lửng 2 lầu , sân thượng trước sau, có cửa sổ phòng sau và sân sau lộng gió. 5PN 4WC, phòng khách rộng, xe hơi ngủ trong nhà, nội thất đầy đủ :tủ giường, TV, máy lạnh đaikin đời mới, rủ rượu, bếp gỗ tự nhiên. Nhà xây để ở, kiên cố ép cọc Việt Nhật 4 tim/ cột, có bản vẽ kiến trúc, kết cấu đầy đủ và tư liệu video nghiệm thu để so sánh chuyên nghiệp cho thầy thợ.', 0x000000000101000000dfeaef5be3ac5a40ff791a30489a2540, 79, 765, 26941, 143, '90/61', NULL, NULL, '90/61 Vũ Tùng, Phường 02, Quận Bình Thạnh, Thành phố Hồ Chí Minh', '', 8.99, 2, 8990000000, '4.00', '13.00', '0.00', NULL, '0', 'VNĐ', '0.00', '0.00', 0, NULL, NULL, NULL, NULL, 2, 1, 8, 0, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 1, NULL, 2, 94283, NULL, 246, NULL, '2020-11-17 14:07:24', '2020-11-18 08:27:09', NULL, NULL, NULL, 0, NULL, NULL, 69477, NULL, 1, NULL, NULL, NULL),
