(140276, NULL, '- Dân trí tạm, không cao lắm, có nuôi gà, và tổ chức nhậu nhẹt.\r\n- Đầu hẻm là tiệm hớt tóc, trong hẻm thì kinh doanh cho thuê phòng, văn phòng công ty và ở.\r\n- Nhà còn mới, chủ nhà mới xây hoặc sửa năm 2019, diện tích xây dựng 39.7m2, diện tích sàn 139.6m2, kết cấu trệt 2 lầu sân thượng, có 6 phòng ngủ.\r\n- Cách mặt tiền chỉ tầm 50m, gần đoạn Huỳnh Văn Bánh và Trần Huy Liệu, bán kính 1km xung quanh đầy đủ các tiện ích như trường học, bệnh viện, ngân hàng,....\r\n- Nhà hướng Đông Bắc, nhà 3 mặt tiền hẻm, khuôn đất 3.58*13.1m, hậu hơi cong cong, nhà không bị cống, cột điện,....\r\n- Ngọc Quý + Tuyết Mai nhập.', 0x00000000010100000086c0475b6cab5a4038a8f2cd6d952540, 79, 768, 27082, 181, '175/6', NULL, NULL, '175/6 Huỳnh Văn Bánh, Phường 12, Quận Phú Nhuận, Thành phố Hồ Chí Minh', '', 8.4, 2, 8400000000, '3.60', '13.10', '48.30', NULL, '0', 'VNĐ', '39.70', '139.60', 3, NULL, NULL, NULL, NULL, 2, 1, 6, NULL, NULL, 3, NULL, 1, 6, 5, 1, NULL, 1, NULL, 5, NULL, NULL, 1, NULL, 2, 92161, NULL, 230, NULL, '2020-11-17 17:58:29', '2020-11-18 08:30:06', NULL, NULL, NULL, 0, NULL, NULL, 139500, NULL, 1, NULL, NULL, NULL),
