(140281, NULL, '+ Nhà mới hoàn công, sổ hồng chính chủ.\r\n+ DT: 5,75x18,5m = 108.12m2, nở hậu 6m.\r\n+ Gồm: 1 hầm + 1 trệt shophouse + 4 lầu: Có 18 phòng ngủ nội thất cao cấp chuẩn khách sạn đang kinh doanh.\r\n+ Các phòng đều có ban công, full nội thất nhập khẩu, trang bị hệ thống thang máy, hệ thống Camera an ninh, PCCC đã được quận nghiệm thu, có giấy phép hoạt động.\r\n+ Đang cho thuê full phòng, thu nhập 200 - 250 tr/tháng.\r\n+ Hai mặt tiền: Đường trước nhà nhựa 9m, mặt sau hẻm 2m.\r\n+ Đường 18A Nguyễn Thị Minh Khai, Phường Đa Kao Quận 1.\r\n+ Khu kinh doanh căn hộ dịch vụ được ưa chuộng khó kiếm căn thứ 2 như này.\r\n+ Hợp đồng thuê dài hạn còn 4 năm.\r\n+ Giao dịch trực tiếp Chính chủ.', NULL, 79, 760, 26737, 37, '18A/23+18A/25', NULL, NULL, '18A/23+18A/25 Nguyễn Thị Minh Khai, Phường Đa Kao, Quận 1, Thành phố Hồ Chí Minh', '', 55, 2, 55000000000, '6.00', '18.00', '0.00', NULL, '0', 'VNĐ', '0.00', '0.00', 3, NULL, NULL, NULL, NULL, 0, 3, 0, 1, NULL, 5, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 0, NULL, NULL, 1, NULL, 2, 94323, NULL, 237, NULL, '2020-11-17 19:38:03', '2020-11-18 08:31:17', NULL, NULL, NULL, 0, NULL, NULL, 119354, NULL, 1, NULL, NULL, NULL),
