(140398, NULL, '- Khu vực an ninh, dân trí cao, kinh doanh sầm uất, nhộn nhịp, khu sung.\r\n- Khu vực kinh doanh khách sạn, nhà hàng, karaoke, chuỗi cửa hàng ăn uống, làm văn phòng, cho thuê phòng và ở.\r\n- Nhà còn mới, xây khoảng được 5 năm, kết cấu 4 lầu 1 sân thượng, có 13PN, 13WC.\r\n- Đây là mặt tiền Hoa Lan, nằm ngay vòng xoay Nguyễn Công Hoan với Trường Sa, cách Phan Xích Long chỉ 50m, cách Trường Sa chỉ 50m, và rất gần nhiều đường Hoa khác, xung quanh có đầy đủ tiện ích như trường học, bệnh viện, ngân hàng,......\r\n- Nhà vị trí tốt, khuôn đất 4*18m, công nhận hết 72m2, vuông vức, nhà hướng Đông Bắc, không bị các lỗi phong thủy như đâm đường, cống, cột điện,.....', 0x000000000101000000bbfe1fce2cac5a406371107307982540, 79, 768, 27061, 238, '49', NULL, NULL, '49 Hoa Lan, Phường 02, Quận Phú Nhuận, Thành phố Hồ Chí Minh', '', 21.5, 2, 21500000000, '4.00', '18.00', '72.00', NULL, '55000000', 'VNĐ', '72.00', '244.60', 3, NULL, NULL, NULL, NULL, 1, 1, 6, 0, NULL, 4, NULL, 1, 13, 13, 1, 1, 1, NULL, 6, NULL, NULL, 1, NULL, 2, 94599, NULL, 232, NULL, '2020-11-21 16:08:32', '2020-11-21 22:30:28', NULL, NULL, NULL, 0, NULL, NULL, 87186, NULL, 1, NULL, NULL, NULL),
