(140423, NULL, '- Dân trí cao\r\n- Mô hình văn phòng, kinh doanh dịch vụ.\r\n- Nhà mới, đẹp. Mới cho thuê văn phòng HĐT 5 năm. Năm đầu: 50tr/tháng. Năm 2-3: 55tr/tháng. Từ năm 4 - 5: 60tr/tháng. Chủ nhà mong muốn bán và không hủy HĐT.\r\n- Nhà MT đẹp, gần ngã tư và là đường chính thông ra các đường lớn khác: Nguyễn Thị Minh Khai, Đinh Tiên Hoàng, Vòng xoay Điện Biên Phủ, cầu Thị Nghè, .... \r\n- Nhưng bị khuyết điểm là đường 1 chiều.\r\n- Khuôn đất nở hậu, không bị lộ giới.', 0x0000000001010000002d4abf3310ad5a40e2957f8868932540, 79, 760, 26740, 5467, '25H', NULL, NULL, '25H Nguyễn Bỉnh Khiêm, Phường Bến Nghé, Quận 1, Thành phố Hồ Chí Minh', '', 27, 2, 27000000000, '6.30', '5.10', '33.70', 801.00, '50000000', 'VNĐ', '10.00', '127.30', 3, NULL, NULL, 1, NULL, 1, 1, 6, NULL, NULL, 4, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8, NULL, NULL, 1, NULL, 2, 94706, NULL, 242, NULL, '2020-11-22 18:00:08', '2020-11-22 19:40:58', '2020-11-22 19:40:58', NULL, NULL, 0, '2020-11-22 17:43:24', NULL, NULL, NULL, 0, NULL, NULL, NULL),
(140424, NULL, '- Dân trí ổn.\r\n- Mô hình cho thuê ở, căn hộ dịch vụ, homestay.\r\n- Nhà mới xây.\r\n- Cách MT 100m. Gần về Võ Văn Kiệt, ngay khu trung tâm lớn của ngân hàng thành phố, người nước ngoài đông.\r\n- Khuôn đất nở hậu, hẻm bé khi vào nhưng dính lộ giới ít lắm, sau này mở đường thì cũng sẽ đẹp rất nhiều. Trông chờ vào tương lai.', 0x000000000101000000e61027e68fac5a40d2fe0758ab862540, 79, 760, 26752, 4971, '6/5', NULL, NULL, '6/5 Đề Thám, Phường Cầu Ông Lãnh, Quận 1, Thành phố Hồ Chí Minh', '', 6.4, 2, 7000000000, '5.00', '5.00', '20.50', 341.00, '20000000', 'VNĐ', NULL, NULL, 3, NULL, NULL, 1, NULL, 2, 1, 6, NULL, NULL, 4, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 3, NULL, NULL, 1, NULL, 3, 94707, NULL, 242, NULL, '2020-11-22 18:48:31', '2020-11-28 15:26:42', NULL, NULL, NULL, 0, '2020-11-22 18:00:08', NULL, NULL, 0, 0, NULL, NULL, NULL),
