(140426, NULL, '- Dân trí tạm, khu vực được, an ninh.\r\n- Khu vực kinh doanh các cửa hàng quán ăn uống là chính, bún quậy, quán nhậu, cơm, bún, cà phê, văn phòng và ở......\r\n- Nhà còn sử dụng được, kết cấu trệt lửng 2 lầu sân thượng, diện tích đất xây dựng 22.9m2, diện tích sàn 102.2m2.\r\n- Nhà cách mặt tiền Trường Sa tầm 200m, đối diện CoopMart Nhiêu Lộc, gần cầu số 8, cách mặt tiền Lê Văn Sỹ tầm 200m, trước nhà đường nhựa 8m.\r\n- Nhà vị trí tạm, hướng chính Tây, 4.25m*5.8m top hậu còn 4m, không cống cột điện, đâm đường,.....', 0x000000000101000000597c4f543aab5a40d8a28ba12a932540, 79, 770, 27130, NULL, '359/48', NULL, NULL, NULL, '', 6.5, 2, 6500000000, '4.30', '5.80', '22.90', NULL, '20000000', 'VNĐ', '22.90', '102.20', 3, NULL, NULL, NULL, NULL, 2, NULL, 2, NULL, NULL, 3, 1, 1, 4, 2, 1, 1, 1, NULL, 10, NULL, NULL, 1, NULL, 2, 86758, NULL, 180, NULL, '2020-11-22 20:24:25', '2020-11-23 10:43:37', NULL, NULL, NULL, 0, NULL, NULL, 137864, NULL, 1, NULL, NULL, NULL),
