(140514, NULL, 'CHÍNH CHỦ đăng tin.\r\nĐúng địa chỉ - Hình thật.\r\nMong gặp khách thiện chí.\r\nMIỄN TIẾP BÁO MẠNG.\r\n\r\n280/3/1 Huỳnh Văn Bánh, P.11, Q.Phú Nhuận\r\n\r\n*** Mô tả:\r\n+ DT: 58.2m2 (3.85x15.5m). Hướng Bắc.\r\n+ Lộ giới hông 0.7m. Hiện tại XÂY ĐỦ 3m85 (1 trệt 1 lầu)\r\n+ Nhà 2 MẶT TIỀN, có cửa bên hông, lấy gió và sáng tự nhiên.\r\n+ Nhà đẹp, 2 lầu, 3 PN - 3 WC, BTCT,...\r\n+ Trang bị hệ thống NĂNG LƯỢNG MẶT TRỜI.\r\n+ Hẻm trước nhà và bên hông 3.5m. Cách mặt tiền 10m.\r\n+ Nhà đẹp, vào ở ngay.\r\n\r\n*** Vị trí:\r\n+ Khu vực buôn bán sầm uất.\r\n+ Gần chợ (Trần Hữu Trang, Phạm Văn Hai), siêu thị Co.op.\r\n+ Đi các quận đều thuận tiện.\r\n\r\n*** Giá bán: 7.1 tỷ (thương lượng NHẸ).\r\n\r\n*** Gửi anh/chị giới thiệu: 1%.', 0x000000000101000000093ebc9d33ab5a40e7d6b5076b952540, 79, 768, 27073, 5341, '280/3/1', NULL, NULL, '280/3/1 Huỳnh Văn Bánh, Phường 11, Quận Phú Nhuận, Thành phố Hồ Chí Minh', '', 7.1, 2, 7100000000, '3.80', '15.00', '57.00', NULL, '0', 'VNĐ', '0.00', '0.00', 3, NULL, NULL, NULL, NULL, 2, NULL, 1, NULL, NULL, 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1, NULL, 2, 95065, NULL, 240, NULL, '2020-11-26 09:13:13', '2020-11-26 11:18:12', NULL, NULL, NULL, 0, NULL, NULL, 138041, NULL, 1, NULL, NULL, NULL),
