(140572, NULL, 'Nhà 6T thang máy cạnh nhà ga ngầm Metro 5 Bà Chiểu.\r\n\r\nSổ hồng 11/2018, DT đất = DTCN 92m2, DTSD 394m2, DT sàn 430m2, giá 15,7 tỷ.\r\n\r\nNhà riêng phường 14, Quận Bình Thạnh, HXH đường Bạch Đằng, 4 phút đến Q1, tiện vừa ở vừa cho thuê hoàn toàn tách biệt nhau cùng kết hợp cơ hội đầu tư 3 năm sau. Ngoài cho thuê sinh lời rất ổn định như thực tế 7 năm qua và hiệu quả đầu tư trong tầm tay nhờ lợi thế nằm cạnh nhà ga ngầm Bà Chiểu của tuyến Metro 5 dự kiến khởi công năm 2023, bốn ưu điểm nổi bật khác là:\r\n\r\n•	Vị trí: Nhà nằm giữa 2 mặt tiền đường song song, cách đường lớn Bạch Đằng 20m và Huỳnh Đình Hai 30m. Cách chợ Bà Chiểu 70m và UBND Quận Bình Thạnh 100m, 4 phút đến Q1.\r\n•	Đi lại: Nằm ngay khu trung tâm hành chính quận, nơi kết nối 4 trục đường lớn Bạch Đằng, Đinh Tiên Hoàng, Phan Đăng Lưu và Lê Quang Định. Chỉ ít bước là đến 6 trạm xe buýt đi 4 hướng và đặc biệt nhà ga metro ngầm Bà Chiểu. \r\n•	Tiện ích: Nhiều đơn vị hành chính, giáo dục, y tế (bệnh viện), thương mại và giải trí cấp quận và thành phố quanh gần nhà . Khu vực có lịch sử cao ráo, quanh năm không hề bị ngập nước ngay cả khi mưa lớn liên tục nhiều giờ trong mùa triều cường.\r\n•	An ninh: HXH cụt rất yên tỉnh dài 30m, rộng 5m (lộ giới 6m) chỉ gồm 12 căn nhà và có cổng hẻm riêng. Hiện có 5 văn phòng công ty thuê.\r\n\r\nNhà không vi phạm lộ giới, hướng đông nam, móng cọc và băng, vách đôi cách nhiệt và chống thấm, giếng trời, hệ thống chống sét. Đầy đủ nội thất với thang máy 6 tầng, 8P ngủ, 8 WC/tắm, 6P đa dụng, 4P bếp, 10 máy lạnh, điện 3 pha, nước nóng NLMT, ban công cây cảnh 40m2, internet, TH cáp, camera.\r\n\r\nỞ 2 tầng trên và cho thuê 4 tầng dưới thu nhập 40tr/th. Sinh hoạt và đi lại độc lập.\r\nVợ chồng chúng tôi (chính chủ) quyết định để lại nội thất trong 6 tầng cho bên mua và tôn trọng mọi thương lượng giá của khách mua. Về hoa hồng, anh/chị vui long cho biết. Về phía chúng tôi, xin mạn phép đưa ra đề nghị hoa hồng môi giới từ 1% đến 2% tùy theo giá bán được. Mong muốn lắng nghe thêm ý kiến của anh/chị. \r\nXin chân thành cám ơn.', 0x000000000101000000ed0e2906c8ac5a407f8f55a5889b2540, 79, 765, 26935, 3119, '356/6/1', NULL, NULL, '356/6/1 Bạch Đằng, Phường 14, Quận Bình Thạnh, Thành phố Hồ Chí Minh', '', 15.7, 2, 15700000000, '9.00', '12.70', '91.70', 171.00, '40', 'VNĐ', '88.70', '393.80', 3, NULL, NULL, 1, NULL, 2, 1, 8, NULL, NULL, 4, NULL, 1, 10, 8, 1, NULL, 1, NULL, 5, NULL, NULL, 1, NULL, 3, 95285, NULL, 138, NULL, '2020-11-27 13:59:34', '2020-11-27 13:59:34', NULL, NULL, NULL, 0, '2020-11-27 13:47:32', NULL, NULL, NULL, 0, NULL, NULL, NULL),
