(140633, NULL, 'Hẻm xe hơi, hẻm 69/ D2 sầm uất không khác gì nhà mặt tiền.\r\n\r\n- Diện tích: 4,5 x 28m. Nở hậu. DT công nhận: 140 m2. Nhà nở hậu đẹp, không lỗi phong thuỷ gì nha.\r\n- Đang có sẵn GPXD: 1 trệt + 3 lầu + 1 sân thượng.\r\n\r\n- Khu vực điểm nóng của Khu D, Khu chuyên khai thác cho thuê CHDV. Tập trung 4 trường ĐH lớn: ĐH Hutech, Ngoại Thương, GTVT, Hồng Bàng... Lượng sinh viên cực lớn, nhu cầu thuê CHDV - phòng trọ rất cao, luôn luôn full phòng.\r\n- Cách ĐH Hutech, GTVT, Ngoại Thương 3p đi bộ, sinh viên đi bộ rất nhiều. Khuôn đất diện tích vuông đẹp, rất phù hợp xây lên mô hình CHDV tầm 30 phòng, bên dưới KD cafe/tiệm giặt ủi. Thu nhập í 150tr/th.\r\n- Sổ hồng chính chủ.', 0x00000000010100000069d1f187d5ad5a40ae80423d7d9c2540, 79, 765, 26920, 5480, '69/39B', NULL, NULL, '69/39B Nguyễn Gia Trí, Phường 25, Quận Bình Thạnh, Thành phố Hồ Chí Minh', '', 15, 2, 15000000000, '4.50', '28.00', '126.00', 119.00, NULL, 'VNĐ', NULL, NULL, 0, NULL, NULL, 1, NULL, 2, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 3, 95466, NULL, 246, NULL, '2020-11-28 15:33:19', '2020-11-28 19:59:33', NULL, NULL, NULL, 0, '2020-11-28 15:30:43', NULL, NULL, NULL, 0, NULL, NULL, NULL),
