(140680, NULL, 'Diện tích vuông vức tuyệt đối: 6 x 20m. DTCN 120m2.\r\n- Kết cấu: 1 trệt 4 lầu, sân thượng, Gồm 12 phòng CHDV rộng rãi, WC riêng, cửa sổ thoáng mát từng phòng. Hiện đang full phòng, thu nhập sẵn.\r\n- Sổ vuông vức. Đường 8m, 2 xe hơi ra vào thoải mái, đường thông tiện đi lại, Khu cư xá công an cực an ninh và dân trí cao. Nhà mới đẹp, ko cần sửa chữa gì, sân đậu xe máy dư giả.\r\n- Sổ hồng hoàn công hợp lệ.', 0x000000000101000000ab5b3d27bdac5a40cfdbd8ec489d2540, 79, 765, 26917, 4911, '70/55A', NULL, NULL, '70/55A Bùi Đình Túy, Phường 12, Quận Bình Thạnh, Thành phố Hồ Chí Minh', '', 13.5, 2, 13500000000, '6.00', '20.00', '120.00', NULL, '112.5', 'VNĐ', '0.00', '0.00', 3, NULL, NULL, NULL, NULL, 2, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1, NULL, 2, 95462, NULL, 246, NULL, '2020-11-30 06:32:40', '2020-11-30 11:12:18', NULL, NULL, NULL, 0, NULL, NULL, 140632, NULL, 1, NULL, NULL, NULL),
(140681, NULL, 'Hẻm xe hơi. Khu bàn cờ chỉnh chu, có vỉa hè. Tập trung 90% văn phòng Cty trong hẻm này. Đường xá rộng rãi, 2 xe hơi né nhau. Thông ra Phạm Văn Đồng, rất tiện đi lại.\r\n\r\n- Diện tích: 4,7 x 12m. Vuông vức tuyệt đối. Công nhận 52,1 m2 trên sổ.\r\n- Nhà cấp 4 đã đập thành đất trống, tiện xây mới ngay.\r\n- GPXD: 1 trệt, 1 lửng, 3 lầu, 1 sân thượng. Bancol trên lầu được đu ra 1,2m. Tối ưu diện tích sàn sử dụng, Khu này cấp phép xây dựng cao hơn hẳn những nơi khác. Xung quanh đã xây cao tầng hết rồi, còn trống mỗi khuôn đất này, rất hiếm.\r\n- Sổ hồng chính chủ 1 người.', 0x000000000101000000d73043e389ac5a40ef38454772a12540, 79, 765, 26908, NULL, '354/25D', NULL, NULL, NULL, '', 4.9, 2, 4900000000, '4.70', '12.00', '624.00', NULL, '94.23', 'VNĐ', '0.00', '0.00', 3, NULL, NULL, NULL, NULL, 0, 1, 0, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, NULL, 1, NULL, 0, NULL, NULL, 1, NULL, 2, 95470, NULL, 246, NULL, '2020-11-30 06:37:49', '2020-11-30 11:12:40', NULL, NULL, NULL, 0, NULL, NULL, 140635, NULL, 1, NULL, NULL, NULL),
