(140719, NULL, 'Nhà mới, đẹp, 01 trệt + 02 lầu, 03 toilet, hẻm rộng 10m, ngay trung tâm quận 3, HCM. Nhà gần chợ, siêu thị, trường học, bệnh viện, trung tâm thương mại, thuận tiện đi tới quận 1, 5, 8, 10 ...\r\n\r\nNhà sạch sẽ, thoáng mát, hợp phong thủy, kinh doanh làm ăn tốt, phù hợp cho để ở kết hợp kinh doanh buôn bán hoặc cho thuê lại với giá cao. Nhà được trang bị 02 máy lạnh, hệ thống bếp, hệ thống đèn đầy đủ.\r\n\r\nGiá bán rẻ bất ngờ do chính chủ cần bán để đi định cư nước ngoài, không thể có căn nhà nào chất lượng mà rẻ hơn, nhà có sổ hồng đầy đủ, hợp lệ, có thể vay ngân hàng dễ dàng.', 0x00000000010100000053060e6869ab5a4016bab7c7778a2540, 79, 770, 27154, 133, '664/128', NULL, NULL, '664/128 Nguyễn Đình Chiểu, Phường 03, Quận 3, Thành phố Hồ Chí Minh', '', 7.2, 2, 7200000000, '3.00', '13.00', '0.00', NULL, '0', 'VNĐ', '0.00', '0.00', 3, NULL, NULL, NULL, NULL, 0, NULL, 0, 0, NULL, 2, NULL, NULL, NULL, 3, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1, NULL, 2, 95739, NULL, 237, NULL, '2020-11-30 23:18:47', '2020-12-01 10:09:03', NULL, NULL, NULL, 0, NULL, NULL, 38576, NULL, 1, NULL, NULL, NULL),
