(140771, NULL, 'Căn góc mặt tiền Thích Quảng Đức và hẻm 6m, Đường 2 chiều kinh doanh rất tốt. DT 5X14, công nhận đất 70m2, Nhà BTCT 4tầng và sân thượng.\r\n\r\nNhà tiện ở và KD, trong đó trệt và lầu 1 là mặt bằng kinh doanh rộng hơn 130m2 (cho thuê 35tr/tháng),\r\n\r\n3 Tầng để ở, có 4 phòng, sân thượng có mái che, Có gara xe hơi 7c cửa hông, cólối đi riêng với MB kinh doanh. Tiện ở và KD phòng mạch, quán ăn, cửa hàng...cho thuê,\r\nnhà mới xây lại xong 2019 đã hoàn công, ở lâu dài rất phát triển, do gia đình định cư nên bán gấp,\r\n\r\nTừ nhà ra :\r\ncông viên Gia Định (600m),\r\nsiêu thi Coop Mark (500m),\r\nkhu Phan Xích Long và Phạm Văn Đồng (1km)\r\nSân Bay và Quận 1 (3km)', 0x00000000010100000082ec50a882ab5a4041ae1e413b9d2540, 79, 768, 27043, 297, '207', NULL, NULL, '207 Thích Quảng Đức, Phường 04, Quận Phú Nhuận, Thành phố Hồ Chí Minh', '', 16.8, 2, 16800000000, '5.00', '14.00', '70.00', NULL, '0', 'VNĐ', '0.00', '0.00', 0, NULL, NULL, NULL, NULL, 0, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1, NULL, 2, 84751, NULL, 189, NULL, '2020-12-02 10:55:53', '2020-12-02 10:56:59', NULL, NULL, NULL, 0, NULL, NULL, 137075, NULL, 1, NULL, NULL, NULL),
