(140928, NULL, 'Nhà cách đường NVT 50m.\r\n\r\n2 mặt tiền hẻm ( thông HVB ), 4 mặt thoáng. Sân rộng trước nhà - 4 xe oto đậu và quay đầu thoải mái.\r\n\r\n10 phút đến sân bay, hoặc đến q1, đường rộng đẹp, lề rộng, đặc biệt thông thoáng, không ứ tắc giao thông.\r\n\r\nVị trí này, tuyến đường này - không có căn thứ 2 so sánh.\r\n\r\nNở hậu, 4.6x12m, công nhận 55m2.\r\n\r\n1 trệt 1 lầu, thiết kế phong cách hiện đại châu Âu, phù hợp gia đình nhỏ ở kết hợp làm văn phòng ( phía trước đang cho thuê kinh doanh ). Full nội thất xịn mịn, vào ở ngay.\r\n\r\nHẻm rất sạch, an ninh , sát trường học và ngân hàng\r\n\r\nGiá: 15.8t TL', 0x000000000101000000417fa1478cab5a40cec3094ca7952540, 79, 768, 27082, 4913, '95/47', NULL, NULL, '95/47 Nguyễn Văn Trỗi, Phường 12, Quận Phú Nhuận, Thành phố Hồ Chí Minh', '', 14.5, 2, 14500000000, '4.60', '12.30', '54.80', NULL, '0', 'VNĐ', '54.80', '113.90', 3, NULL, NULL, NULL, NULL, 2, 1, 0, NULL, NULL, 2, NULL, 1, 3, 3, 1, 1, NULL, NULL, 10, NULL, NULL, 1, NULL, 2, 92916, NULL, 230, NULL, '2020-12-05 23:46:59', '2020-12-06 10:09:08', NULL, NULL, NULL, 0, NULL, NULL, 139550, NULL, 1, NULL, NULL, NULL),
(140929, NULL, 'Chính chủ cần bán gấp căn nhà đẹp nằm trên trục đường chính của Quận 3 tại địa chỉ: Đường Nam Kỳ Khởi Nghĩa, Phường 7, Quận 3, Tp Hcm\r\n- Diện tích : 62m2\r\n- Dtsd : 144m2\r\n- Hướng Đông Bắc\r\n- Kết cấu nhà Btct 1 trệt 2 lầu còn mới đẹp được xây dựng kiên cố và vững chắc gồm: 3 phòng ngủ, 4 Wc, phòng khách, bếp rộng rãi và thoáng mát\r\n- Đặc biệt nhà có sân rộng đỗ xe ôtô. Đây là điều rất hiếm gặp với các ngôi nhà trên con đường này\r\n- Nhà mặt tiền có vị trí đẹp ngay trung tâm, trên trục đường chính của Quận 3. Gần ngã 4 Nam Kỳ Khởi Nghĩa - Lý Chính Thắng\r\n- Nằm trong khu dân cư ổn định, an ninh đảm bảo, yên tĩnh. Gần trường học, chợ, bệnh viện. Thuận tiện giao thông đi lại và thích hợp mở văn phòng công ty, kinh doanh, buôn bán\r\n- Giá bán: 17,5 tỷ\r\nKhách hàng có thiện chí liên hệ Sđt: 0913.539.878 - chính chủ ạ!', 0x00000000010100000046038271bcab5a40ec24088a61942540, 79, 770, 27124, 164, '303', NULL, NULL, '303 Nam Kỳ Khởi Nghĩa, Phường 07, Quận 3, Thành phố Hồ Chí Minh', '', 13.5, 2, 17500000000, '3.10', '20.30', '61.90', 283.00, NULL, 'VNĐ', '51.50', '144.10', 3, NULL, NULL, 1, NULL, 2, 1, 6, NULL, NULL, 3, NULL, 1, 3, 4, 1, NULL, 1, NULL, 10, NULL, NULL, 1, NULL, 3, 96426, NULL, 138, NULL, '2020-12-06 10:06:54', '2021-02-18 14:38:04', NULL, NULL, NULL, 0, '2020-12-06 09:55:10', NULL, NULL, 0, 0, NULL, NULL, NULL),
