(141033, NULL, 'NỞ BỤNG 8m, có 2 gác gỗ.  NHÀ CHO THUÊ = 25tr/th.  Nhà gần ngã 4 Trần Quốc Thảo, ngã tư Võ Thị Sáu giao với Pastuer, Võ Thị Sáu/Nam Kỳ Khởi Nghĩa, đối diện xéo Ban chỉ huy quân sự quận 3, đang CT bán cà phê. HĐ còn 3 năm. Ưu tiên khách mua giữ lại hợp đồng, SHCC, 11 tỷ thương lượng bớt lộc.', NULL, 79, 770, 27124, 184, '175', NULL, NULL, '175 Võ Thị Sáu, Phường 07, Quận 3, Thành phố Hồ Chí Minh', '', 11, 2, 11000000000, '5.30', '13.00', '66.50', NULL, '0', 'VNĐ', '0.00', '0.00', 2, NULL, NULL, NULL, NULL, 1, 1, 5, 0, NULL, 0, NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1, NULL, 2, 93744, NULL, 232, NULL, '2020-12-10 11:45:54', '2020-12-10 13:34:18', NULL, NULL, NULL, 0, NULL, NULL, 129831, NULL, 1, NULL, NULL, NULL),
(141034, NULL, 'Nhà có 3 mặt tiền, mặt tiền đường Võ Thị Sáu, đoạn sầm uất Quận 3, và 2 mặt tiền hẻm, nhà thuộc lề phải đường, nhà rất sáng, thoáng và mát quanh năm\r\nTầng trệt, ngang 3,3 dài 19 m, Đặc biệt lên tầng 1 đến tầng 4, nở rộng chiều ngang ra thành 3,8 m, tổng sàn sử dụng 314 m2\r\nXe ô tô đậu trong nhà, nhà có cửa hông để đi xe gắn máy riêng , rất thuận tiện, tầng trệt dành để xe ô tô và xe gắn máy ( nếu cần thiết)\r\nNhà có 1 trệt và 4 lầu, rất đẹp, sổ hồng, Nhà lót sàn gỗ mới rất đẹp, mỗi tầng có 1 nhà vệ sinh riêng\r\nNhà hướng Đông Nam, Nhà có hẻm hông là hẻm cụt, rất an ninh và yên tĩnh, một vài hộ dân cao cấp ở.\r\nNhà có 4 đồng điện và 4 đồng hồ nước, gắn và sử dụng thang máy ( sử dụng 1 đồng hồ điện riêng) rất thuận tiện lên xuống và tiết kiệm điện\r\n\r\nNhà rất thuận tiện để ở và kinh doanh, mua bán, làm văn phòng công ty, vì khu vực này rất sầm uất và kinh doanh tốt quận 3 ( được đánh giá là Trung tâm tài chính và kinh tế của Quận 3)', 0x000000000101000000179cc1df2fac5a406a696e85b0922540, 79, 770, 27121, 184, '164', NULL, NULL, '164 Võ Thị Sáu, Phường 08, Quận 3, Thành phố Hồ Chí Minh', '', 18, 2, 18000000000, '3.30', '18.00', '0.00', NULL, '0', 'VNĐ', '0.00', '0.00', 0, NULL, NULL, NULL, NULL, 1, 1, 7, 0, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1, NULL, 2, NULL, NULL, 246, NULL, '2020-12-10 11:50:35', '2020-12-10 13:34:26', NULL, NULL, NULL, 0, NULL, NULL, 40629, NULL, 1, NULL, NULL, NULL),
(141035, NULL, 'Căn góc mặt tiền Thích Quảng Đức và hẻm 6m, Đường 2 chiều kinh doanh rất tốt. DT 5X14, công nhận đất 70m2, Nhà BTCT 4tầng và sân thượng.\r\n\r\nNhà tiện ở và KD, trong đó trệt và lầu 1 là mặt bằng kinh doanh rộng hơn 130m2 (cho thuê 35tr/tháng),\r\n\r\n3 Tầng để ở, có 4 phòng, sân thượng có mái che, Có gara xe hơi 7c cửa hông, cólối đi riêng với MB kinh doanh. Tiện ở và KD phòng mạch, quán ăn, cửa hàng...cho thuê,\r\nnhà mới xây lại xong 2019 đã hoàn công, ở lâu dài rất phát triển, do gia đình định cư nên bán gấp,\r\n\r\nTừ nhà ra :\r\ncông viên Gia Định (600m),\r\nsiêu thi Coop Mark (500m),\r\nkhu Phan Xích Long và Phạm Văn Đồng (1km)\r\nSân Bay và Quận 1 (3km)', 0x00000000010100000082ec50a882ab5a4041ae1e413b9d2540, 79, 768, 27043, 297, '207', NULL, NULL, '207 Thích Quảng Đức, Phường 04, Quận Phú Nhuận, Thành phố Hồ Chí Minh', '', 16.8, 2, 16800000000, '5.00', '14.00', '70.00', NULL, '0', 'VNĐ', '0.00', '0.00', 0, NULL, NULL, NULL, NULL, 1, 1, 6, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 5, NULL, NULL, 1, NULL, 2, 84751, NULL, 232, NULL, '2020-12-10 11:50:57', '2020-12-10 13:34:33', NULL, NULL, NULL, 0, NULL, NULL, 137075, NULL, 1, NULL, NULL, NULL),
