(141183, NULL, 'Hai mặt tiền HXH, nhà xây kiên cố đúc 3,5 tấm Kết cấu: trệt, 2 lầu, sân thượng. Có 2PN lớn, 2ban công, 1 phòng thờ, 1 phòng khách kiểu tây hiện đại, 3WC. Nhà nằm mặt tiền hẻm thông, rất thuận tiện đi lại. Kiến trúc nhà hiện đại cao cấp, đẹp, sang trọng, có cảnh sông cực kì đẹp từ nhà ra bờ sông Hoàng Sa. Sổ hoàn công 2019. Giá chốt nhanh trong tuần 8,5 tỷ (thương lượng nhẹ) cho khách thiện chí. Sổ hoàn công 2019, nhà đang thế chấp ngân hàng nên nói khách thiện chí mua nhà thì đặt cọc ít nhất 20%, sau đó chủ nhà đi giải thế chấp vài ngày là ra công chứng. HH 1% cho Mg, tuy nhiên nếu khách mua nhanh trong tuần thì chủ nhà gửi 100tr thay vì 1%. Bán gấp 8,5 tỷ tl nhẹ cho khách mua nhanh, qua tuần giá 9,5 tỷ. Người nhập: Nguyên Cẩm Hiền.', NULL, 79, 760, 26740, 18, '212/325', NULL, NULL, '212/325 Nguyễn Văn Nguyễn, Phường Bến Nghé, Quận 1, Thành phố Hồ Chí Minh', '', 8.5, 2, 8500000000, '3.40', '8.00', '25.80', NULL, '0', 'VNĐ', '25.80', '71.10', 3, NULL, NULL, NULL, NULL, 2, 1, 7, 0, NULL, 2, NULL, 1, 2, 3, NULL, 1, 1, NULL, 0, NULL, NULL, 1, NULL, 2, 97123, NULL, 240, NULL, '2020-12-15 10:45:04', '2020-12-15 12:38:12', NULL, NULL, NULL, 0, NULL, NULL, 85388, NULL, 1, NULL, NULL, NULL),
