(141243, NULL, 'NHÀ ĐỘC QUYỀN\r\nThu Nhập Thụ Động trung bình 60tr/th\r\nBán Nhà Hẻm Xe Tải 8m trải nhựa đường Lê Văn Sỹ, Q.3.\r\nKết Cấu : 1 Trệt 2 lầu, nhà cũ tiện xây mới\r\nChi phí xây dựng + Nội thất cơ bản : 2 Tỷ\r\nCông năng khai thác : xây CHDV : 1 Trệt (1 phòng + chỗ để xe ) + 1 Lững ( 1 phòng ) + 3 Lầu ( 6 phòng ) + 1 sân thượng ( 1 phòng + sân phơi ) = 9 phòng\r\nGiá thuê : 6tr/th x 9 phòng = 54tr/th ( Nội Thất Cơ Bản )\r\n7tr/th x 9 phòng = 63tr/th ( Full Nội Thất )', 0x00000000010100000091099d7c1fab5a409c9d561bad942540, 79, 770, 27127, 1550, '220/160A', NULL, NULL, '220/160A Lê Văn Sỹ, Phường 14, Quận 3, Thành phố Hồ Chí Minh', '', 12.9, 2, 12900000000, '4.50', '14.00', '63.00', 205.00, '7', 'VNĐ', '65.00', '0.00', 3, NULL, NULL, 1, NULL, 2, 1, 7, NULL, NULL, 3, NULL, 1, 9, 10, 1, NULL, NULL, NULL, 5, NULL, NULL, 1, NULL, 3, 97289, NULL, 256, NULL, '2020-12-16 11:41:20', '2021-01-29 16:36:56', NULL, NULL, NULL, 0, '2020-12-16 11:33:52', NULL, NULL, 0, 0, NULL, NULL, NULL),
