(141248, NULL, 'Dành cho khách hàng mua đầu tư - kinh doanh - giữ tiền.\r\nTrung tâm Quận 10 hot.\r\nBán nhà 2 mặt tiền hẻm xe hơi 666 đường 3/2, Phường 14, Quận 10.\r\n+ Diện tích: 2,7 x 12m, diện tích công nhận 30,4m2.\r\n+ Kết cấu: 1 trệt + 2 gác suốt, tổng DTSD 90m2.\r\n+ Vị trí: Hẻm 666 đường 3/2, P14, Q10. Con hẻm rộng rãi, sầm uất bậc nhất khu vực. Thông ra đường Lý Thường Kiệt, 3/2, Nguyễn Kim.\r\nNhà 2 mặt tiền trước và sau. Mặt tiền trước là hẻm 666/28, mặt tiền sau là hẻm 666/30, tất cả đều là hẻm xe hơi, cách MT hẻm 666 chỉ 30m.\r\n+ Khả năng sử dụng: Nhà vừa sơn sửa sạch đẹp, hiện đang ngăn đôi cho thuê trước và sau tổng thu nhập 16tr/th.\r\n+ Vị trí đẹp, tiện kinh doanh nhiều lĩnh vực, hoặc xây mới cho gia đình ở.\r\n+ Tiện ích xung quanh: Khu vực văn phòng, công ty, trường ĐH, rất nhiều dịch vụ tiện ích khác, gần chợ ngân hàng, trường học, siêu thị,.\r\n+ Quan trọng nhất: Độ thanh khoản nhanh, giá trị tăng cao, có lời chắc chắn.\r\n+ Giá chào bán: Chỉ 5,2 tỷ - Thương lượng giá tốt nhất cho khách hàng thiện chí!\r\n+ Thủ tục pháp lý rõ ràng, sổ hồng chính chủ, sang tên công chứng trong ngày\r\nGiá cực rẻ, thấp hơn giá thị trường rất nhiều, không còn căn thứ 2 có vị tốt hơn giá rẻ hơn, cơ hội tốt nhất để đầu tư BĐS khu trung tâm Sài Gòn.\r\n\r\nChốt trước TẾT HH 100tr', 0x0000000001010000008a89720e43aa5a40496760e465892540, 79, 771, 27169, 1569, '666/28/1', NULL, NULL, '666/28/1 3 Tháng  2, Phường 14, Quận 10, Thành phố Hồ Chí Minh', '', 5.2, 2, 5200000000, '2.70', '12.00', '32.40', 160.00, NULL, 'VNĐ', NULL, NULL, 0, NULL, NULL, 1, NULL, 2, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 3, 97306, NULL, 237, NULL, '2020-12-16 13:47:17', '2020-12-16 15:58:04', NULL, NULL, NULL, 0, '2020-12-16 13:44:43', NULL, NULL, NULL, 0, NULL, NULL, NULL),
