(141516, NULL, '+ Nhà 1 trệt 3 lầu BTCT chủ tự xây,36m2 đất.\r\n+Ngang 4.1 nở hậu 4.45, dài 8.35m\r\n+Nhà xây BTCT 2018,4 phòng ngủ,4 vệ sinh.\r\n+Diện tích sàn hơn 130m2 rộng cho gia đình đông người.\r\n+Sân thượng trồng rau,ăn nhậu thỏa thích và có thể cải tạo được 2 phòng ngủ.\r\n+Trước nhà rộng để xe máy ô tô đi qua không cần phải cất tránh.\r\n+ Tiện ích khu vực phường 3 Phạm văn Hai ngay chợ nổi tiếng xưa nay saigon,đi đâu cũng thuận tiện.\r\n+An ninh và sạch đẹp,dân trí thân thiện hiền lành thật thà,đèn trang trí Noel lung linh từ cổng vào nhà.\r\n+Sổ hồng không lộ giới,không quy hoạch.hồ sơ hoàn công 2019.', 0x0000000001010000000892770e65aa5a4014d1afad9f962540, 79, 766, 26980, 4933, '154/8A', NULL, NULL, '154/8A Phạm Văn Hai, Phường 03, Quận Tân Bình, Thành phố Hồ Chí Minh', '', 4.8, 2, 4800000000, '4.00', '8.50', '34.00', 141.00, NULL, 'VNĐ', NULL, NULL, 0, NULL, NULL, 1, NULL, 2, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 3, 97851, NULL, 255, NULL, '2020-12-22 17:10:47', '2020-12-22 17:46:09', NULL, NULL, NULL, 0, '2020-12-22 17:01:12', NULL, NULL, NULL, 0, NULL, NULL, NULL),
