(141527, NULL, '- Dân trí cao, khu vực sầm uất, an ninh, tuyến đường lắp đặt nhiều camera an ninh .\r\n- Khu vực kinh doanh đủ ngành nghề: Văn phòng, coffee, hàng quán ăn uống, ministop, spa, nail, văn phòng, cho thuê phòng và ở\r\n- Nhà xây khoảng năm 2010, nhà vừa lấy lại hợp đồng thuê nên nhìn hơi cũ, diện tích xây dựng 38.5m2, diện tích sàn 117.9m2, kết cấu 1 trệt 2 lầu, có 4 phòng ngủ và 3 WC.\r\n- Đây là mặt tiền Phùng Văn Cung, cách mặt tiền Phan Xích Long khoảng 100m, cách mặt tiền Phan Đăng Lưu 200m, cách mặt tiền Cầm Bá Thước khoảng 30m, gần ngã tư Phú Nhuận, gần bệnh viện Hoàn Mỹ, ngân hàng, cao ốc, văn phòng.....\r\n- Nhà hướng Đông Bắc, nhà có 2 mặt tiền, mặt sau hẻm 2m, khuôn đất 4.34*10m, vuông vức, công nhận 41.5m2, vị trí tốt, không bị các lỗi phong thủy như cống, cột điện......', 0x00000000010100000005c84e4ed8ab5a40c16659f34f9a2540, 79, 768, 27061, 160, '93', NULL, NULL, '93 Phùng Văn Cung, Phường 02, Quận Phú Nhuận, Thành phố Hồ Chí Minh', '', 12.8, 2, 12800000000, '4.30', '10.00', '41.50', NULL, '0', 'VNĐ', '38.50', '117.90', 3, NULL, NULL, NULL, NULL, 1, 1, 6, NULL, NULL, 3, NULL, 1, 4, 3, 1, NULL, NULL, NULL, 8, NULL, NULL, 1, NULL, 2, 97887, NULL, 240, NULL, '2020-12-22 17:39:05', '2020-12-22 17:47:58', NULL, NULL, NULL, 0, NULL, NULL, 136595, NULL, 1, NULL, NULL, NULL),
