(141554, NULL, 'Kết cấu: 1 trệt, 3 lầu, sân thượng. Nhà được thiết kế sang trọng phong cách châu Âu với không gian mở, thoáng đón nắng gió. Dưới tầng trệt được dùng để làm gara có thể để được 2 ô tô còn thiết kế thêm 1WC và 2 phòng dùng làm phòng cho người giúp việc và nhà kho. \r\n- Tầng 1 được thiết kế không gian mở dùng làm phòng khách và nhà bếp. \r\n- Tầng 2 được thiết kế 1 phòng ngủ master, bên trong đầy đủ nội thất, thiết kế rộng rãi có WC, phòng tủ đồ. \r\n- Tầng 3 được chia làm 2 phòng, 2WC dùng làm phòng ngủ cho các con, NTCC. \r\n- Trên sân thượng có thiết kế 1 phòng thờ, 1 phòng là nơi giải trí và nơi còn lại dùng làm khu vực nấu ăn giải trí BBQ. \r\n- Giá 21 tỷ thương lượng, cho thuê 52tr/th.', NULL, 79, 766, 26977, 381, '343/99H', NULL, NULL, '343/99H Nguyễn Trọng Tuyển, Phường 01, Quận Tân Bình, Thành phố Hồ Chí Minh', '', 21, 2, 21000000000, '7.10', '11.00', '75.50', NULL, '52000000', 'VNĐ', NULL, '270.60', 3, NULL, NULL, NULL, NULL, 0, 3, 0, 0, NULL, 4, NULL, 1, 3, 3, 1, NULL, 1, NULL, 0, NULL, NULL, 1, NULL, 2, 97977, NULL, 240, NULL, '2020-12-23 13:20:59', '2020-12-23 19:21:32', NULL, NULL, NULL, 0, NULL, NULL, 108471, NULL, 1, NULL, NULL, NULL),
