(141572, NULL, 'ngay kế bên trung tâm Quận 3, khu vực an ninh yên tĩnh.\r\n- Nhà xây kiên cố, hiện đang cho thuê 11tr/tháng\r\nDiện tích đất 34.122 m2, Diện tích sàn xây dựng 30m2 (nở hậu 3.3 m), tổng diện tích sử dụng thực tế 150m2, nhà 4 tầng + sân thượng (1 trệt, 3 lầu, sân thượng); sân trước 4m2; gồm 3 phòng + 4 toilet. Có máy nước nóng năng lượng mặt trời, tắm nước nóng quanh năm không lo bị điện giật, an toàn tuyệt đối.\r\nNhà hướng Đông Bắc, căn góc 2 mặt tiền quanh năm mát mẻ. Hẻm rộng, dân cư yên tĩnh, nhà có sân thượng, thoáng mát thích hợp cho gia đình yêu thích trồng cây cảnh hoặc rau củ cung cấp thực phẩm sạch cho gia đình.\r\nXung quanh gần bệnh viện Nhi Đồng, Bình Dân, 115, Nguyễn Tri Phương... Các trung tâm thương mại như Vạn Hạnh Mall, Hà Đô Centrosa, Charmington La Pointe Cao Thắng, siêu thị Co.op, Siêu thị Aeon, tiệm thời trang và các dịch vụ ăn uống khác.\r\nVị trí ngay tuyến đường Cao Thắng, Điện Biên Phủ thông các hẻm ra 3/2, nguyễn Thiện Thuật, Nguyễn Đình Chiểu, Võ Văn Tần, Nguyễn Thị Minh Khai Quận 1 cực gần. Thuận tiện đi lại các quận 1, 2, 3, 4, 5, 6, 7, 8, 10, 11...\r\nNhà mới xây đẹp, mua vào ở ngay', 0x000000000101000000ca84043175ab5a4011476815478b2540, 79, 771, 27175, 304, '482/15/15', NULL, NULL, '482/15/15 Điện Biên Phủ, Phường 11, Quận 10, Thành phố Hồ Chí Minh', '', 5.7, 2, 5700000000, '3.28', '10.50', '0.00', NULL, '0', 'VNĐ', '0.00', '0.00', 0, NULL, NULL, NULL, NULL, 0, NULL, 0, 0, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 2, NULL, 2, 98033, NULL, 246, NULL, '2020-12-23 16:54:05', '2020-12-24 09:22:12', NULL, NULL, NULL, 0, NULL, NULL, 44072, NULL, 1, NULL, NULL, NULL),
