(142382, NULL, 'Nhà xây dựng kiên cố bê tông cốt thép nhà 1 triệt, 1 lầu, sảnh rộng ở tầng triệt đang cho thuê mặt bằng và có 1 phòng lớn, lầu 1 có 5 phòng sạch đẹp, wc với thiết bị cao cấp. ☑️ Mời quý khách chọn quyền lợi tốt : ☑️ Chọn đủ: GPXD được cho phép xây dựng tầng hầm, 1 lững, 6 đến 7 tầng, diện tích sàn mới tăng đến 899m² (Cam kết bao giấy phép xây dựng) ☑️ Đủ điều kiện và diện tích phân lô tách thửa 2 lô đất ☑️ Thuận lợi: Spa cao cấp, KD online… nâng cấp đầu tư cho thuê phòng trọ hạng sang vip cao cấp thu nhập 5 đến 6 triệu/phòng hay chọn đâu tư thấp KD phòng trọ sạch đẹp cho sinh viên học sinh thuê, thu vốn lợi nhuận rất nhanh. ☑️ Quyền lợi cộng thêm: Mặt bằng và phòng cho thuê cộng 19 triệu ,5 phòng ở lầu 1 đang cho sinh viên thuê 3tr/tháng/phòng, thu nhập ổn định, quý khách cải tạo thêm có đến 12 phòng', 0x0000000001010000001d91ef52eaaa5a40730f09dffb932540, 79, 768, 27085, 1580, '115/132/14', NULL, NULL, '115/132/14 Lê Văn Sỹ, Phường 13, Quận Phú Nhuận, Thành phố Hồ Chí Minh', '', 16, 2, 16000000000, '4.50', '24.00', '0.00', NULL, '0', 'VNĐ', '0.00', '0.00', 0, NULL, NULL, NULL, NULL, 0, NULL, 0, 0, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1, NULL, 2, NULL, NULL, 246, NULL, '2021-01-11 15:36:27', '2021-01-12 17:29:44', NULL, NULL, NULL, 0, NULL, NULL, 74378, NULL, 1, NULL, NULL, NULL),
