(142584, NULL, 'Diện tích đất: 4.55m (nở hậu 10.5m) x 19m, sổ hồng công nhận 123.9m2. Gồm 1 trệt + 1 lửng và 2 lầu, tổng DT sàn 301.5m2, có sân trước... Nhà cũ tiện sửa chữa hoặc xây mới (phía sau nhà là dự án cao ốc mặt tiền Hồ Con Rùa và góc Phạm Ngọc Thạch đang xây dựng), chủ quyền tư nhân, sổ hồng mới cấp năm 2018.\r\n- Vị trí nhà ngay cạnh Hồ Con Rùa, gần Nhà văn hóa Thanh niên và sát 2 trường đại học lớn (Kinh Tế và Kiến trúc)... là khu vui chơi và giải trí rất nhộn nhịp của nhiều bạn trẻ thành phố cả ngày lẫn đêm. Nhà nằm trong hẻm cụt khu nội bộ chừng 15 căn, cách mặt tiền chừng 40m, hẻm trước nhà rộng 5m xe tải vô ra thoải mái. Khu vực tập trung nhiều cao ốc văn phòng - CN ngân hàng và kinh doanh nhà hàng - cà phê - cơm văn phòng và căn hộ dịch vụ cao cấp rất sầm uất... Dân cư an ninh và yên tĩnh, môi trường thoáng mát, giao thông đi lại nhộn nhịp và thuận tiện...\r\n- Rất tiện để kinh doanh nhiều ngành nghề hoặc xây mới (khu được xây dựng 1 hầm + 5 lầu) để làm văn phòng công ty - kinh doanh căn hộ dịch vụ cao cấp kết hợp showroom - nhà hàng - cafe...', 0x0000000001010000006ade718a8eac5a4001a5a14621912540, 79, 770, 27139, 368, '38', NULL, NULL, '38 Trần Cao Vân, Phường 06, Quận 3, Thành phố Hồ Chí Minh', '', 31, 2, 31000000000, '4.50', '19.00', '85.50', 363.00, NULL, 'VNĐ', NULL, NULL, 3, NULL, NULL, 1, NULL, 2, 1, 6, NULL, NULL, 4, NULL, NULL, 6, 4, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 3, 100044, NULL, 256, NULL, '2021-01-15 09:32:36', '2021-02-27 15:01:40', NULL, NULL, NULL, 0, '2021-01-15 09:27:08', NULL, NULL, 0, 0, NULL, NULL, NULL),
