(142750, NULL, 'Đường hẻm 8m.\r\n- Diện tích: 4 x 12,75m (51m2).\r\n- Kết cấu: 1 trệt 3 lầu, sân thượng. WC riêng, cửa sổ thoáng mát từng phòng. Hiện đang cho thuê làm văn phòng (20 triệu/tháng) thu nhập sẵn.\r\n- Đường 8m, 2 xe hơi ra vào thoải mái, Khu này cực an ninh và dân trí cao. Đường bàn cờ xe hơi tiện đi lại. Sân đậu xe máy dư giả.\r\n- Gần chung cư Wilton Tower, giao với đường Nguyễn Văn Thương, thuận tiện kinh doanh và buôn bán,...\r\n- Tiện ích xung quanh trường mẫu giáo 25B (400m), trường cấp 2 Đống Đa, cấp 3 Gia Định, trường Quốc tế, trường ĐH giao thông vận tải, Hutech, Ngoại Thương,... (bán kính trong 1km), chợ Văn Thánh, bách hoá xanh, siêu thị, Pearl Plaza,....\r\n- Pháp lý rõ ràng: Sổ hồng riêng. Sang tên ngay.\r\n- Thuận tiện đi vào trung tâm thành phố quận 1, quận 2,...', NULL, 79, 765, 26920, 277, '1/61', '1/61 đường Võ Oanh', NULL, '1/61 D3, Phường 25, Quận Bình Thạnh, Thành phố Hồ Chí Minh', '1/61 đường Võ Oanh', 13, 2, 13000000000, '4.00', '12.70', '51.00', 255.00, NULL, 'VNĐ', NULL, NULL, 0, NULL, NULL, 1, NULL, 0, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 3, 100398, NULL, 246, NULL, '2021-01-19 15:45:09', '2021-01-20 08:37:00', NULL, NULL, NULL, 0, '2021-01-19 15:42:59', NULL, NULL, NULL, 0, NULL, NULL, NULL),
