(143213, NULL, 'Nhà cách đường NVT 50m.\r\n\r\n2 mặt tiền hẻm ( thông HVB ), 4 mặt thoáng. Sân rộng trước nhà - 4 xe oto đậu và quay đầu thoải mái.\r\n\r\n10 phút đến sân bay, hoặc đến q1, đường rộng đẹp, lề rộng, đặc biệt thông thoáng, không ứ tắc giao thông.\r\n\r\nVị trí này, tuyến đường này - không có căn thứ 2 so sánh.\r\n\r\nNở hậu, 4.6x12m, công nhận 55m2.\r\n\r\n1 trệt 1 lầu, thiết kế phong cách hiện đại châu Âu, phù hợp gia đình nhỏ ở kết hợp làm văn phòng ( phía trước đang cho thuê kinh doanh ). Full nội thất xịn mịn, vào ở ngay.\r\n\r\nHẻm rất sạch, an ninh , sát trường học và ngân hàng\r\n\r\nGiá: 15.8t TL', 0x000000000101000000417fa1478cab5a40cec3094ca7952540, 79, 768, 27082, 4913, '95/47', NULL, NULL, '95/47 Nguyễn Văn Trỗi, Phường 12, Quận Phú Nhuận, Thành phố Hồ Chí Minh', '', 14.5, 2, 14500000000, '4.60', '12.30', '54.80', NULL, '0', 'VNĐ', '54.80', '113.90', 3, NULL, NULL, NULL, NULL, 2, 1, 5, NULL, NULL, 2, NULL, 1, 3, 3, 1, 1, NULL, NULL, 10, NULL, NULL, 1, NULL, 2, 92916, NULL, 232, NULL, '2021-01-29 14:37:23', '2021-01-29 16:36:41', NULL, NULL, NULL, 0, NULL, NULL, 139550, NULL, 1, NULL, NULL, NULL),
(143214, NULL, '- Dân trí cao, an ninh, yên tĩnh.\r\n- Mô hình kinh doanh phù hợp  khai thác căn hộ dịch vụ, cho thuê mặt bằng trệt để kinh doanh, hoặc cho thuê làm spa, massage, homestay, hotel, văn phòng hay là ở đều được.\r\n- Nhà mới sửa mới năm 2020, vừa gắn thêm thang máy, trệt lửng 2 lầu sân thượng, có bán hầm.\r\n- Cách mặt tiền Phan Đăng Lưu 100m, mặt tiền Đoàn Thị Điểm 50m, mặt tiền Phan Xích Long 200m.\r\n- Phong thủy tốt, hướng Đông Nam, 4.3*16.5m, nhà vuông vức, không cống, không cột điện.', 0x000000000101000000e13e3cc9aeab5a407ddf12b637992540, 79, 768, 27058, 235, '29/21', NULL, NULL, '29/21 Đoàn Thị Điểm, Phường 01, Quận Phú Nhuận, Thành phố Hồ Chí Minh', '', 16.5, 2, 16500000000, '4.30', '16.50', '70.90', NULL, '0', 'VNĐ', '61.10', '255.40', 3, NULL, NULL, NULL, NULL, 2, 1, 8, NULL, NULL, 3, NULL, 1, 6, 6, 1, NULL, 1, 1, 6, NULL, NULL, 2, NULL, 2, 80296, NULL, 264, NULL, '2021-01-29 15:13:31', '2021-01-29 16:36:47', NULL, NULL, NULL, 0, NULL, NULL, 135885, NULL, 1, NULL, NULL, NULL),
(143215, NULL, 'NHÀ ĐỘC QUYỀN\r\nThu Nhập Thụ Động trung bình 60tr/th\r\nBán Nhà Hẻm Xe Tải 8m trải nhựa đường Lê Văn Sỹ, Q.3.\r\nKết Cấu : 1 Trệt 2 lầu, nhà cũ tiện xây mới\r\nChi phí xây dựng + Nội thất cơ bản : 2 Tỷ\r\nCông năng khai thác : xây CHDV : 1 Trệt (1 phòng + chỗ để xe ) + 1 Lững ( 1 phòng ) + 3 Lầu ( 6 phòng ) + 1 sân thượng ( 1 phòng + sân phơi ) = 9 phòng\r\nGiá thuê : 6tr/th x 9 phòng = 54tr/th ( Nội Thất Cơ Bản )\r\n7tr/th x 9 phòng = 63tr/th ( Full Nội Thất )', 0x00000000010100000091099d7c1fab5a409c9d561bad942540, 79, 770, 27127, 1550, '220/160A', NULL, NULL, '220/160A Lê Văn Sỹ, Phường 14, Quận 3, Thành phố Hồ Chí Minh', '', 12.9, 2, 12900000000, '4.50', '14.00', '63.00', NULL, '7', 'VNĐ', '65.00', '0.00', 3, NULL, NULL, NULL, NULL, 2, 1, 7, NULL, NULL, 3, NULL, 1, 9, 10, 1, NULL, NULL, NULL, 5, NULL, NULL, 1, NULL, 2, 97289, NULL, 212, NULL, '2021-01-29 15:16:56', '2021-01-29 16:36:56', NULL, NULL, NULL, 0, NULL, NULL, 141243, NULL, 1, NULL, NULL, NULL),
