(143409, NULL, 'Dự án: Biệt thự quận 3.\r\nThông tin chi tiết: Bán biệt thự Tú Xương\r\n60 tỷ- 163 m²\r\n61A, Đường Tú Xương, Phường 7, Quận 3, Tp Hồ Chí Minh\r\nDự án: Bán biệt thự Tú Xương.\r\nThông tin chi tiết: Bán biệt thự 163 m2 Tú Xương P7 1 trệt 2 lầu Quận 3 vừa hoàn thiện, giá thương lượng .\r\nMô tả:\r\n+ Diện tích sử dụng: 163m2,\r\n+ Kết cấu: 1 trệt 2 lầu sân thượng kiên cố, rộng rãi.\r\n+ Gồm 4 phòng ngủ, 5 nhà vệ sinh, giếng trời thoáng mát, phòng khách, phòng bếp, phòng thờ đầy đủ công năng, trang bị nội thất sang trọng phù hợp cho đại gia đình sử dụng ở liền.\r\n+ Vị trí: nằm ngay trung tâm quận 3.\r\n+ Gần chợ, công viên thoáng mát, trường học, bệnh viện, UBND, siêu thị...đảm bảo an ninh tuyệt đối.\r\n+ Pháp lý: sổ hồng chính chủ, công chứng trong ngày.\r\n+ Giá; 60 tỷ Thương lượng cho khách có thiện chí.\r\n+ Xem nhà liên hệ: để được tư vấn và sổ.', 0x000000000101000000dc2dc901bbab5a40fe63213a048e2540, 79, 770, 27124, 288, '61a', NULL, NULL, '61a Tú Xương, Phường 07, Quận 3, Thành phố Hồ Chí Minh', '', 60, 2, 60000000000, '7.80', '20.90', '162.80', 369.00, NULL, 'VNĐ', '162.80', '331.90', 3, NULL, NULL, 1, NULL, 2, NULL, 6, NULL, NULL, 3, NULL, NULL, 4, 5, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 3, 101646, NULL, 228, NULL, '2021-02-05 10:06:11', '2021-02-19 08:43:35', NULL, NULL, NULL, 0, '2021-02-05 09:55:51', NULL, NULL, 0, 0, NULL, NULL, NULL),
