(143467, NULL, 'Tên đường cũ là D1, Nguyễn Văn Thương là tên đường mới.\r\nDT trên sổ là 4x21,15. DT công nhận thực tế là 67,7m2. Nhà có lề đường 3,7m.\r\nNhắc đến P.25 khu đường D của Bình Thạnh thì đây là khu đắc địa. D2 được ví là khu Phan Xích Long của Phú Nhuận, thậm chí hơn Phú Nhuận. Vì đường D2 khan hiếm nhà MT bán. Bên này toàn biệt thự & đại gia đi xế hộp thứ dữ. Ngoài ra, về giá trị tương lai, năm 2023 sẽ có tuyến Metro hiện đại nhất cả nước gần khu này.\r\nD1 ko sầm uất = D2 nhưng khu đường D là khu có giá cao.\r\nNhà hiện để trống. Đối diện nhà là bệnh viện tư nhân chuyên về thẩm mỹ. Đường thông Ung Văn Khiêm, tiện di chuyển ra Hàng Xanh, Q.1, Q.2, Phú Nhuận.\r\n\r\nMs Thanh + Ms Thư đi khảo sát gặp.', 0x0000000001010000005572a9a514ae5a40806264c91c9b2540, 79, 765, 26920, 5471, '140', NULL, NULL, '140 Nguyễn Văn Thương, Phường 25, Quận Bình Thạnh, Thành phố Hồ Chí Minh', '', 18, 2, 18000000000, '4.00', '21.20', '67.70', 266.00, NULL, 'VNĐ', '67.70', '141.60', 3, NULL, NULL, 1, NULL, 1, 1, 5, NULL, NULL, 2, NULL, 1, 2, 1, 1, NULL, 1, NULL, 15, NULL, NULL, 1, NULL, 3, 101842, NULL, 177, NULL, '2021-02-08 14:26:29', '2021-02-09 10:41:39', NULL, NULL, NULL, 0, '2021-02-08 14:12:45', NULL, NULL, NULL, 0, NULL, NULL, NULL),
