(143588, NULL, 'Hẻm thông hai đầu đi vào từ 115 Trần Quốc Thảo hoặc 232 Võ Thị Sáu\r\nSau lưng Uỷ ban nhân dân quận 3\r\nKhu vực hành chính, an ninh.\r\nYên tĩnh, an toàn.\r\nGiá còn TL.\r\n\r\nKhu này khúc đầu hẻm thì yên tĩnh, sạch sẽ, sang trọng, dân trí cao. Còn chạy vào tới chỗ ngã tư, quẹo trái thì ra hẻm 232 Võ Thị Sáu, quẹo phải thì sẽ vào đc ngôi nhà này, thì hẻm rất nhỏ. Chỉ thích hợp để ở hoặc làm DHCV, nếu mua và sửa lại nhà. Vì khu này rất yên tĩnh, xe hơi đậu dài dài.', 0x000000000101000000fdd8243fe2ab5a402c2cb81ff0902540, 79, 770, 27124, 185, '115/1H', NULL, NULL, '115/1H Trần Quốc Thảo, Phường 07, Quận 3, Thành phố Hồ Chí Minh', '', 13, 2, 13000000000, '4.00', '15.00', '60.00', 217.00, NULL, 'VNĐ', '59.60', '164.70', 2, NULL, NULL, 1, NULL, 2, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 3, NULL, NULL, 243, NULL, '2021-02-19 08:53:46', '2021-02-20 16:33:06', NULL, NULL, NULL, 0, '2021-02-19 08:49:56', NULL, NULL, 0, 0, NULL, NULL, NULL),
(143589, NULL, 'Chị mình cần bán nhà Quận 3, hiện đang cho thuê 50 - 60 triệu / tháng\r\nĐịa chỉ: hẻm 18/82A Trần Quang Diệu, Phường 14, Quận 3, thành phố Hồ Chí Minh\r\nNhà thuộc trung tâm thành phố, vị trí đắc địa, gần chợ Nguyễn Văn Trỗi, Q3 , gần trường Đại học Tài Nguyên và Môi trường, cho thu nhập tốt hàng tháng mà vẫn đảm bảo vốn đầu tư luôn gia tăng.\r\nNhà có diện tích ngang 4,3m x 17,5m ( nở hậu 4,75m). Xây chắc chắn 1 trệt, 4 lầu, tổng cộng 18 phòng, toilet riêng từng phòng, đang cho thuê, thu nhập từ 50-60 triệu/tháng. Tỷ lệ full phòng từ 90- 100%. Có khu vực để xe máy riêng .\r\n* Vị trí : hẻm đối diện chợ Nguyễn Văn Trỗi, gần siêu thị, trường học từ mẫu giáo đến đại học, bệnh viện và các tiện ích công cộng. Nhà trọ ở ngay trung tâm tiện cho việc di chuyển, làm việc, học tập đến tất cả các quận.\r\n* Về An Ninh : do nằm gần UBND và công an phường nên an ninh rất tốt , có bảo vệ dân phố trực thường xuyên . Bên cạnh đó dãy trọ còn được trang bị hệ thống camera giám sát 24/24, giúp gia chủ quản lý được từ xa thông qua Smart phone và một bảo vệ riêng cho nhà trọ.\r\n* Pháp lý : sổ hồng riêng đã hoàn công đầy đủ\r\n* Thu nhập từ phòng trọ quá ok nhưng do cần tiền gấp, nên bán đại hạ giá: 12 tỷ .\r\nRất vui được tiếp khách có thiện ý mua, các báo đăng tin quảng cáo vui lòng đừng liên hệ', 0x000000000101000000c57421567fab5a403ba8c4758c932540, 79, 770, 27127, 129, '18/82A', NULL, NULL, '18/82A Trần Quang Diệu, Phường 14, Quận 3, Thành phố Hồ Chí Minh', '', 12, 2, 12000000000, '4.30', '14.10', '60.60', 198.00, '50000000', 'VNĐ', NULL, '307.20', 3, NULL, NULL, 1, NULL, 2, 1, 0, NULL, NULL, 5, NULL, NULL, 18, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 3, 102236, NULL, 243, NULL, '2021-02-19 09:11:57', '2021-02-19 09:12:21', NULL, NULL, NULL, 0, '2021-02-19 08:58:53', NULL, NULL, NULL, 0, NULL, NULL, NULL),
(143590, NULL, 'Bán nhà 39 Quốc Lộ 13, Quận Bình Thạnh. Nhà mặt tiền đường lớn (40m), trục đường chính kết nối thành phố Thủ Đức với trung tâm TP. HCM. Bến Xe Miền Đông mới đã chính thức đi vào hoạt động ở TP. Thủ Đức và Bến Xe hiện tại ở QL13 sẽ chuyển thành trung tâm thương mại phức hợp. Nhà có GPXD 8 tầng, phù hợp khách sạn, toà nhà văn phòng. Sổ hồng công chứng ngay trong ngày.', NULL, 79, 765, 26914, 177, '39', NULL, NULL, '39 Quốc Lộ 13, Phường 26, Quận Bình Thạnh, Thành phố Hồ Chí Minh', '', 15.5, 2, 15500000000, '4.10', '23.00', '94.60', NULL, '0', 'VNĐ', '75.20', '145.30', 2, NULL, NULL, NULL, NULL, 1, 1, 1, 0, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 40, NULL, NULL, 1, NULL, 2, NULL, NULL, 128, NULL, '2021-02-19 09:31:36', '2021-02-19 09:32:00', NULL, NULL, NULL, 0, NULL, NULL, 125977, NULL, 1, NULL, NULL, NULL),
