(143834, NULL, 'Thông tin chi tiết: +++Cần bán Nhà phố trong KDC Bình Hòa, thuộc dự án Cty Tân Thuận, trục chính hẻm 111/105 Đặng Thùy Trâm, P.13, Q.Bình Thạnh, Tp.HCM, đối diện trường ĐH Văn Lang, CV, bờ sông thoáng mát.\r\n- DT đất công nhận vuông vức: 4m x 16m = 64m2, DTSD gần 230m2, 1 trệt 3 lầu.\r\n- Pháp lý: Chính chủ đã hoàn công xây dựng 07/2026, Chứng chỉ cc thông tin quy hoạch 06/2020.\r\n- Hướng nhà: Tây Nam, trước mặt và bên hông nhà là công viên cây xanh, sông rạch & trường học nên rất thoáng mát.\r\n- Mẫu nhà phố đã được kts thiết kế theo phong cách hiện đại, tặng bản vẽ thiết kế kỹ thuật & phối cảnh nhà, nội thất gỗ, máy nóng lạnh, đèn chùm...\r\n- Đường nhựa thông thoáng 12m, chỉ cách mặt tiền ĐTT 20m, hai bên đường là vỉa hè đã được lát sạch sẽ, đồng bộ.\r\n- Hệ thống điện công cộng, cáp internet, đèn đường chiếu sáng đi âm trong khu vực và xung quanh nhà là dân cư trí thức cao nên rất an ninh và thông thoáng.\r\n- Nhà xây để ở nên làm code nền nhà cao ráo, đã xây 2 dàn đà móng nên rất chắc chắn đảm bảo không ngập nước mưa hay triều cường.\r\n- Vị trí thuận tiện: gần sân bay TSN, Bến xe Miền Đông, Giga mall, Emart, Coop-mart, Bách hóa xanh, Nguyễn Kim, hồ bơi Bình Lợi Trung...đường Nguyễn Xí sắp thông vào ĐTT nên tiềm năng phát triển khu vực còn rất lớn.\r\n- Gần nhà đã có căn cho công ty thuê như Next Step, Lazada, Tri Thức Trẻ, giá trị cho thuê nhà trong khu vực này rất tốt: giá nhà cho thuê 1 trệt 1 lầu 18tr/tháng, nhà 1 trệt 2 lầu 1 ST từ 23tr - 27tr/tháng...', 0x000000000101000000a9e04b3cfbac5a40bce3b96356a82540, 79, 765, 26905, 1448, '111/105', NULL, NULL, '111/105 Đặng Thùy Trâm, Phường 13, Quận Bình Thạnh, Thành phố Hồ Chí Minh', '', 9.85, 2, 9850000000, '4.00', '16.00', '64.00', 154.00, '27000000', 'VNĐ', NULL, NULL, 3, NULL, NULL, 2, NULL, 2, 1, 0, NULL, NULL, 3, NULL, NULL, 6, 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 3, NULL, NULL, 261, NULL, '2021-02-24 11:22:32', '2021-02-24 12:49:05', NULL, NULL, NULL, 0, '2021-02-24 11:17:12', NULL, NULL, NULL, 0, NULL, NULL, NULL),
(143835, NULL, '- Dân trí ổn, khu vực cũng an ninh.\r\n- Nhà kết cấu trệt lửng 2 lầu, diện tích xây dựng 15.9m2, diện tích sàn 66.2m2, có 3 phòng ngủ.\r\n- Khu vực hẻm này có kinh doanh như buôn bán, shop, văn phòng,....\r\n- Vị trí cách mặt tiền Hoàng Sa 20m, cách mặt tiền Trần Văn Đang tầm 50m, gần nhà thờ An Phú, trường tiểu học Trần Văn Đang\r\n- Nhà hướng Đông Nam, 3.3*4.9m, vuông vức, diện tích đất 15.9m2, không bị các lỗi phong thủy như cột điện, đâm đường,....', 0x0000000001010000003999d81710ab5a400d9f9dda87922540, 79, 770, 27133, 5043, '205/55', NULL, NULL, '205/55 Trần Văn Đang, Phường 11, Quận 3, Thành phố Hồ Chí Minh', '', 4.8, 2, 4800000000, '3.30', '4.90', '15.90', 302.00, NULL, 'VNĐ', '15.90', '66.20', 3, NULL, NULL, 1, NULL, 2, 1, 8, NULL, NULL, 3, NULL, 1, 3, 3, 1, NULL, 1, NULL, 6, NULL, NULL, 1, NULL, 3, 102943, NULL, 180, NULL, '2021-02-24 11:30:41', '2021-02-24 12:49:05', NULL, NULL, NULL, 0, '2021-02-24 11:14:13', NULL, NULL, NULL, 0, NULL, NULL, NULL),
