(143925, NULL, 'Địa chỉ là hẻm, nhưng đường siêu to. Như mặt tiền đường.\r\nSau lưng Wilton Tower D1 Bình Thạnh.\r\nKhu sang trọng, yên tĩnh. \r\nNhà mới xây, đang để trống. Thiết kế đẹp\r\nKết cấu: Trệt - Lửng - 2 lầu. Mỗi lầu có 1 phòng ngủ riêng, wc riêng luôn. Nên tính ra nếu lửng làm phòng ngủ luôn thì đc 3 pn 3wc.\r\nPhía trước sân là đất nhà này luôn, do chủ nhà xây thụt vô, chứ đất dài ra bằng nhà kế bên.\r\nTheo sổ hồng chủ gửi cho Hiền thì là sổ cũ, chưa hoàn công.\r\nChú chủ nhà tên Vương Anh, sn 65.\r\nThông tin chi tiết mn cần cứ lại hỏi Hiền nha.\r\nChứ ai cũng gọi cho chú thì hơi phiền chủ nhà, khi nào có khách muốn mua thật thì hãy gọi chủ sau.\r\nAi xem hình sổ mà mờ thì nhắn Hiền, để Hiền gửi qua zalo rõ hơn.\r\nThư + Hiền đi khảo sát thì thấy nhà này.', 0x00000000010100000092d8a49105ae5a40284b08b18e9a2540, 79, 765, 26920, 5471, '71/32', '145/37', 131, '71/32 Nguyễn Văn Thương, Phường 25, Quận Bình Thạnh, Thành phố Hồ Chí Minh', '145/37, Điện Biên Phủ', 6.5, 2, 6500000000, '5.00', '6.00', '27.00', 241.00, NULL, 'VNĐ', NULL, NULL, 3, NULL, NULL, 1, NULL, 2, 1, 7, NULL, NULL, 4, NULL, 1, 2, 3, NULL, NULL, 1, NULL, NULL, NULL, NULL, 1, NULL, 3, 103156, NULL, 258, NULL, '2021-02-25 18:27:48', '2021-02-26 07:57:59', NULL, NULL, NULL, 0, '2021-02-25 18:11:39', NULL, NULL, NULL, 0, NULL, NULL, NULL),
(143926, NULL, 'Đất trống, đi đường D1, hẻm 71 Nguyễn văn thương vào, sau lưng Wilton Tower là thấy mảnh đất này. Địa chỉ cụ thể thì chưa có, nhưng mn đi hẻm 71 vào là thấy. Hẻm to, xe hơi quay đầu được.\r\nDTCN: 75m2, được xay 60m2.\r\n5x15, nhưng nếu xây chỉ 5x12 thôi. Vì khuôn đất bị xéo xéo.\r\nĐất nằm vị trí 2 mặt tiền. \r\nGiá là 10.5 tỷ thương lượng.\r\nXin sổ chủ không cho, có khách dẫn đến sẽ đưa sổ xem, vì gửi nhiều quá rồi không gửi nữa.\r\nThông tin này chủ nhà nói chính xác vậy.\r\nGiá là 10.5 tỷ thương lượng nhiều.\r\n\r\nThư + Hiền đi khảo sát thì thấy.', 0x0000000001010000003337df88eead5a40a3224e27d99a2540, 79, 765, 26920, 5471, '71/40', NULL, NULL, '71/40 Nguyễn Văn Thương, Phường 25, Quận Bình Thạnh, Thành phố Hồ Chí Minh', '', 10.5, 2, 10500000000, '5.00', '15.00', '75.00', 140.00, NULL, 'VNĐ', NULL, NULL, 1, NULL, NULL, 1, NULL, 2, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 6, NULL, NULL, 1, NULL, 3, 103175, NULL, 258, NULL, '2021-02-25 18:40:18', '2021-02-26 07:57:59', NULL, NULL, NULL, 0, '2021-02-25 18:27:48', NULL, NULL, NULL, 0, NULL, NULL, NULL),
