(143996, NULL, 'cấu trúc 1 trệt + 3 lầu + sân trước + sân sau (5 phòng ngủ + 3 WC), sân thượng rộng rãi thoáng mát, diện tích sử dụng 185m2\r\n\r\n- Nhà hẻm xe hơi thông thoáng xây dựng vô cùng kiên cố, có giếng trời, nhà ngay căn bìa có nhiều cửa sổ vô cùng thoáng mát, cầu thang gỗ Gõ Đỏ, toàn bộ cửa nhà & phòng WC là gỗ Căm Xe\r\n\r\n- Nhà gần bến xe Miền Đông, gần chợ, siêu thị, ngân hàng, trường học và nhiều tiện ích khác, giao thông thuận lợi, cách mặt tiền Đinh Bộ Lĩnh khoảng 20m, hướng Đông Bắc', NULL, 79, 765, 26914, 183, '369/1', NULL, NULL, '369/1 Đinh Bộ Lĩnh, Phường 26, Quận Bình Thạnh, Thành phố Hồ Chí Minh', '', 11.5, 2, 11500000000, '5.20', '15.00', '0.00', NULL, '0', 'VNĐ', '0.00', '0.00', 0, NULL, NULL, NULL, NULL, 2, 1, 6, 0, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1, NULL, 2, 93538, NULL, 246, NULL, '2021-02-27 16:29:29', '2021-02-27 16:57:42', NULL, NULL, NULL, 0, NULL, NULL, 80138, NULL, 1, NULL, NULL, NULL),
(143997, NULL, 'Nhà ở giữa cầu Điện Biên Phủ và cầu Thị Nghè (xem hình chỉ đường)\r\n- Diện tích đất: 3,2m x 6,4m = 20,48m2\r\n- Diện tích sàn xây dựng: 85,2m2\r\n- Trệt, lửng, 2 lầu, sân thượng; 2 phòng ngủ; 3 vệ sinh\r\n- Hẽm xe ba gác, cách hẽm xe hơi khoảng 20m, cách đường Trường Sa 60m.\r\n- Có sân chung trước nhà để xe khách\r\n- Hướng nhà: Tây Nam, vuông vức, không lỗi phong thuỷ.\r\n- Kề sát Quận 1, cách cây cầu.\r\n- Nằm giữa 2 trục giao thông lớn: Điện Biên Phủ và Xô Viết Nghệ Tĩnh\r\n- Ra rạch Thị Nghè 2 phút đi bộ, công viên cây xanh mặt nước rất đẹp, đi dạo và tập thể dục rất tốt\r\n- Rất gần chợ Thị Nghè, Thảo Cầm Viên, CLB bơi lội Yết Kiêu\r\n- Gần nhiều trường Đại học.\r\n- Nhà xây dựng đầu năm 2019, kết cấu bê tông cốt thép; Thiết kế nhỏ gọn, đủ chức năng, nhà thông thoáng và tràn ngập ánh sáng tự nhiên; Sử dụng vật liệu, trang thiết bị tốt và đẹp; Nước nóng năng lượng mặt trời; Bếp từ; Mỗi phòng ngủ gắn đồng hồ đo điện, máy lạnh Toshiba, mới, tiết kiệm điện.\r\n- Khu dân cư: náo nhiệt.\r\n- Đang cho thuê: 11 triệu/tháng,', 0x0000000001010000003fc16ad127ad5a40d2448e63da952540, 79, 765, 26950, 3036, '64/22', NULL, NULL, '64/22 Trường Sa, Phường 17, Quận Bình Thạnh, Thành phố Hồ Chí Minh', '', 4, 2, 4000000000, '3.20', '6.40', '20.50', 195.00, NULL, 'VNĐ', NULL, NULL, 3, NULL, NULL, 1, NULL, 2, NULL, 7, NULL, NULL, 3, NULL, NULL, 2, 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 3, 103379, NULL, 246, NULL, '2021-02-27 16:34:55', '2021-02-27 16:57:17', NULL, NULL, NULL, 0, '2021-02-27 16:31:05', NULL, NULL, NULL, 0, NULL, NULL, NULL),
