(144008, NULL, 'Nhà chính chủ, 19/13d Cầm Bá Thước, phường 7, Phú Nhuận, mặt tiền 5m * sâu 8m, diện tích đất 40m2, diện tích xây dựng 135m2, mặt tiền rộng, thoáng, đẹp:\r\n- Nhà xây 1 trệt 3 lầu, 5 phòng ngủ, 5 Wc riêng biệt\r\n- Nhà xây mới kiên cố năm 2017, còn rất mới\r\n- Sổ đỏ chính chủ, không qua trung gian môi giới\r\n- Khu dân cư trí thức, hẻm sạch sẽ, đi bộ ra Phan Xích Long phường 2 (khu mua sắm, ăn uống sầm uất nhất Tphcm) và Phan Đăng Lưu\r\n- Nhà cuối hẻm nên có sân trước riêng biệt rất rộng, có thể để nhiều xe máy hoặc trồng cây, làm tiểu cảnh\r\n- Tầng trệt là khu sinh hoạt chung rộng thoáng, có bàn ăn, bếp, tủ lạnh. 5 phòng ngủ, 5 Wc riêng biệt, mỗi phòng ngủ đều có gắn máy lạnh, tivi, giường, tủ, bàn làm việc. Nhà ở trong bán kính đi bộ tới Phan Xích Long và Phan Đăng Lưu, nên rất tiện cho người nước ngoài thuê theo tháng vì gần nhiều trung tâm ngoại ngữ (Vus, Ila) và trường quốc tế (Việt Úc), cho thuê Airbnb hoặc cho người Việt thuê từng phòng\r\n- Cầu thang thiết kế nằm 1 góc nên có thể đập thông tường 2 phòng, nếu nhu cầu muốn ở phòng rộng\r\n- Để lại toàn bộ nội thất, có thể cho thuê liền hoặc ở\r\n- Khu vực phường 7 Phú Nhuận cao ráo, sạch sẽ, đặc biệt không bao giờ ngập nước!\r\n- Thiện chí bán do gia đình đang sống ở Quận 2, không tiện quản lý bất động sản ở Phú Nhuận\r\nKhông tiếp trung gian, môi giới, quảng cáo dưới mọi hình thức\r\n0936303237', 0x000000000101000000247f30f0dcab5a40895e46b1dc9a2540, 79, 768, 27052, 418, '19/13D', NULL, NULL, '19/13D Cầm Bá Thước, Phường 07, Quận Phú Nhuận, Thành phố Hồ Chí Minh', '', 5.9, 2, 5900000000, '5.00', '8.00', '40.00', 148.00, NULL, 'VNĐ', '135.00', NULL, 3, NULL, NULL, 1, NULL, 2, 1, 0, NULL, NULL, NULL, NULL, NULL, 5, 5, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 3, NULL, NULL, 128, NULL, '2021-02-27 18:16:17', '2021-02-27 18:16:31', NULL, NULL, NULL, 0, '2021-02-27 18:12:07', NULL, NULL, NULL, 0, NULL, NULL, NULL),
